Q7B Q7B_Dictionary::init(Q7B values, Q7B keys)
{
  Q7B_Dictionary *d = new Q7B_Dictionary();
  Q7B q (new Q7B_id(typeid(Q7B_Dictionary).name(), d));   

  if (Q7B_nil(Q7B_LIST(values))){ Q7B_EXCEPTION("List expected"); return Q7B_idnil; }
  if (Q7B_nil(Q7B_LIST(keys))){ Q7B_EXCEPTION("List expected"); return Q7B_idnil; }

  QList<Q7B> v = ((Q7B_List *) values->ref)->values();
  QList<Q7B> k = ((Q7B_List *) keys->ref)->values();    

  if (v.length() != k.length()){ Q7B_EXCEPTION(QString("Dictionary init: Count of keys and values are different %1 %2").arg(v.length()).arg(k.length())); return Q7B_idnil; }

  for (qint64 i = 0; i < v.length(); i++){
    d->me[Q7B_toString2(k.at(i))] = v.at(i);  
  }

  return q;
}











