void Q7B_EXCEPTION(QString a)
{
  if (Q7B_bException) return;
  Q7B_bException = true;

  QString s = QString("%1File '%2'\n at '%3'\n line '%4'").arg(a.isEmpty() ? a : a + "\n\n").arg(Q7B_QtBF()).arg(Q7B_QtBS()).arg(Q7B_QtBL());
  QMessageBox::warning(0, "Runtime Exception", s);
}

