Q7B *q7b_array_get(Q7B o, Q7B a0, Q7B a1, Q7B a2, Q7B a3)
{
  if (o->q7b_array == 0){ Q7B_EXCEPTION("array has not been declared with Dim"); return &Q7B_idnil; }

  
   // QMessageBox::information(0, "*********", QString("%1 %2").arg(o->q7b_array->size()) .arg((long) o->q7b_array));

  qint64 nOffset = q7b_array_offset(o, Q7B_IDqint64(a0), Q7B_IDqint64(a1), Q7B_IDqint64(a2), Q7B_IDqint64(a3), true);
  if (nOffset == -1){ Q7B_EXCEPTION("array offset out of bounds"); return &Q7B_idnil; }

 // Q7B Value;
  
 // Value = o->q7b_array->at(nOffset);
  
  //QMessageBox::information(0, "", QString("ref?"));
  //QMessageBox::information(0, "", QString("ref %1").arg((long) Value.isNull()));

//  if (Value.isNull()) return &Q7B_IDNIL(); // prevent crashing
  if ((*o->q7b_array)[nOffset].isNull()) return &Q7B_idnil; // prevent crashing

  return &(*o->q7b_array)[nOffset];
}

