Q7B *q7b_type_get(Q7B o, Q7B index, Q7B a0, Q7B a1, Q7B a2, Q7B a3)
{
  if (o->q7b_type == 0 /*&& o->q7b_array == 0*/){ Q7B_EXCEPTION(QString("internal error: q7b_type == 0 variable has not been set as a type %1").arg((int)Q7B_IDqint64(index))); return &Q7B_idnil; }
  //if (o->q7b_type == 0){ Q7B_EXCEPTION(QString("variable has not been set as a type %1").arg((int)Q7B_IDqint64(index))); return &Q7B_idnil; }
  
  //Q7B Value = o->q7b_type->at(Q7B_IDqint64(index));

  //QMessageBox::information(0, "q7b_type_get", Value.isNull() ? "NULL!!!" : QString("%1") .arg((int)Value->ref)  );

  if ((*o->q7b_type)[Q7B_IDqint64(index)].isNull()){
    //Q7B Value2 = Q7B_ID();
    //o->q7b_type->replace(Q7B_IDqint64(index), Value2);
   // return Value2;
    //o->q7b_type->replace(Q7B_IDqint64(index), Value2);
    (*o->q7b_type)[Q7B_IDqint64(index)] = Q7B_ID();

    //int asdf = Q7B_IDqint64(a0) >= 0;
    //if (!(Q7B_IDqint64(a0) >= 0)) 
    return &(*o->q7b_type)[Q7B_IDqint64(index)];

    //return Q7B_IDNIL(); // prevent crashing
  } 

  if ((*o->q7b_type)[Q7B_IDqint64(index)]->q7b_array && Q7B_IDqint64(a0) >= 0){ // Q7B_IDqint64(a0) >= 0 needed for MsgBox("UBound", UBound(t2.a2))  

    qint64 nOffset = q7b_array_offset((*o->q7b_type)[Q7B_IDqint64(index)], Q7B_IDqint64(a0), Q7B_IDqint64(a1), Q7B_IDqint64(a2), Q7B_IDqint64(a3), true);
    if (nOffset == -1){ Q7B_EXCEPTION("array offset out of bounds"); return &Q7B_idnil; }      

    QVector<Q7B> *q7b_array = (*o->q7b_type)[Q7B_IDqint64(index)]->q7b_array;

    if ((*q7b_array)[nOffset].isNull()){
  //QMessageBox::information(0, "nOffset", QString("%1") .arg((int)nOffset)  );      
      
      (*q7b_array)[nOffset] = Q7B_ID();
    }

    return &(*q7b_array)[nOffset];          

    //if (Value.isNull()) return Q7B_IDNIL(); // prevent crashing
        
  }  

  return &(*o->q7b_type)[Q7B_IDqint64(index)];
}

