const QPixmap &Q7B_createPixmap(QString n)
{
  static QPixmap qpixmap;

   if (n.length() > 200){ // QString contains binary data

      if (n.left(200).contains("<svg ", Qt::CaseInsensitive)){
        QString m = n;
        m = m.trimmed();
        QSvgWidget w(0);
        w.resize(100, 100);
        QSvgRenderer *r = w.renderer();
        if (r->load(m.toLatin1())){

          QPixmap p(100, 100);
          QPainter painter(&p);
          r->render(&painter);
          qpixmap = p;       
        }
      } else {
         QPixmap pi; pi.loadFromData(n.toLatin1());
         qpixmap = pi;
      }

   } else {
     if (n.isEmpty()){
         static QPixmap empty;
         return empty;
     }

     qpixmap = Q7B_loadPixmap(n.contains(".") ? n : n + ".png");
   }

   return qpixmap;
}

