QIcon Q7B_QByteArray2QIcon(QByteArray ba)
{
  QDataStream d(ba);

  QIcon icon;

  d >> icon;
  return icon;
}

QByteArray Q7B_QIcon2QByteArray(QIcon icon)
{
  QByteArray ba;
  QDataStream d(&ba, QIODevice::WriteOnly);
  d << icon;
  return ba;
}



