{  
  *l = *r;

  return *l; 
}

Q7B Q7B_ISEQUALCLASS(Q7B l, Q7B r)
{
  if (Q7B_nil(l) || Q7B_nil(r)){ Q7B_NULLPOINTEREXCEPTION(); return Q7B_idnil; }

  return Q7B_ID(l->type == r->type);
}

