Q7B Q7B_POWER(Q7B l, Q7B r)
{
  if (Q7B_nil(l) || Q7B_nil(r)){ Q7B_NULLPOINTEREXCEPTION(); return Q7B_idnil; }

  if (l->type == typeid(qint64).name()){
    if (r->type == typeid(qint64).name()){
      return Q7B_ID( pow((qreal) (Q7B_IDqint64(l)), (int) Q7B_IDqint64((r))) );
    }
    if (r->type == typeid(qreal).name()){
      return Q7B_ID( pow((qreal) (Q7B_IDqint64(l)), Q7B_IDqreal((r))) );
    }
    if (r->type == typeid(Q7B_Decimal).name()){
      return Q7B_ID( pow((qreal) (Q7B_IDqint64(l)), (int) ((Q7B_Decimal *) r->ref)->toInteger()) );
    }
  }

  if (l->type == typeid(qreal).name()){
    if (r->type == typeid(qreal).name()){
      return Q7B_ID( pow(Q7B_IDqreal((l)), Q7B_IDqreal((r))) );
    }
    if (r->type == typeid(qint64).name()){
      return Q7B_ID( pow(Q7B_IDqreal((l)), (int) Q7B_IDqint64((r))) );
    }
    if (r->type == typeid(Q7B_Decimal).name()){
      return Q7B_ID( pow(Q7B_IDqreal((l)), (int) ((Q7B_Decimal *) r->ref)->toFloat()) );
    }
  }

  if (l->type == typeid(Q7B_Decimal).name()){
    if (r->type == typeid(Q7B_Decimal).name()){
      return Q7B_ID( pow(((Q7B_Decimal *) l->ref)->toFloat(), (int) ((Q7B_Decimal *) r->ref)->toInteger()) );
    }
    if (r->type == typeid(qint64).name()){
      return Q7B_ID( pow(((Q7B_Decimal *) l->ref)->toFloat(), (int) Q7B_IDqint64((r))) );
    }
    if (r->type == typeid(qreal).name()){
      return Q7B_ID( pow(((Q7B_Decimal *) l->ref)->toFloat(), Q7B_IDqreal((r))) );
    }
  }

  Q7B_CASTEXCEPTION("Number expected");
  return Q7B_ID(false);
}

