Q7B Q7B_IDIV(Q7B l, Q7B r)
{
  if (Q7B_nil(l) || Q7B_nil(r)){ Q7B_NULLPOINTEREXCEPTION(); return Q7B_idnil; }

  if (l->type == typeid(qint64).name()){
    if (r->type == typeid(qint64).name()){
      return Q7B_ID( *((qint64 *) l->ref) / *((qint64 *) r->ref) );
    }
    if (r->type == typeid(qreal).name()){
      return Q7B_ID( *((qint64 *) l->ref) / (qint64) *((qreal *) r->ref) );
    }
    if (r->type == typeid(Q7B_Decimal).name()){
      return Q7B_ID( *((qint64 *) l->ref) / ((Q7B_Decimal *) r->ref)->toInteger() );
    }
  }

  if (l->type == typeid(qreal).name()){
    if (r->type == typeid(qreal).name()){
      return Q7B_ID( (qint64) *((qreal *) l->ref) / (qint64) *((qreal *) r->ref) );
    }
    if (r->type == typeid(qint64).name()){
      return Q7B_ID( (qint64) *((qreal *) l->ref) / *((qint64 *) r->ref) );
    }
    if (r->type == typeid(Q7B_Decimal).name()){
      return Q7B_ID( (qint64) *((qreal *) l->ref) / (qint64) ((Q7B_Decimal *) r->ref)->toFloat() );
    }
  }

  if (l->type == typeid(Q7B_Decimal).name()){
    if (r->type == typeid(Q7B_Decimal).name()){
      Q7B_Decimal d;
      d.setValue( ((Q7B_Decimal *) l->ref)->value() / ((Q7B_Decimal *) r->ref)->value() );
      return Q7B_ID( d );
    }
    if (r->type == typeid(qint64).name()){
      Q7B_Decimal d;
      d.setValue( ((Q7B_Decimal *) l->ref)->value() / (*((qint64 *) r->ref) * 10000) );
      return Q7B_ID( d );
    }
    if (r->type == typeid(qreal).name()){
      Q7B_Decimal d;
      d.setValue( ((Q7B_Decimal *) l->ref)->value() / (qint64) (*((qreal *) r->ref) * 10000) );
      return Q7B_ID( d );
    }
  }

  Q7B_CASTEXCEPTION("Number expected");
  return Q7B_ID(false);
}

