void Q7B_DOEVENTS(Q7B MilliSeconds)
{
  if (Q7B_nil(Q7B_INTEGER(MilliSeconds))){ Q7B_EXCEPTION("Integer expected"); return; }

  qint64 n = Q7B_IDqint64(MilliSeconds);
  if (n > 0){
    qApp->processEvents(QEventLoop::AllEvents, n);
  } else {
    qApp->processEvents();
  }
  
}

void Q7B_EXECAFTERMSEC(Q7B MilliSeconds, Q7B SignalProcedureName, Q7B Object)
{
  QString SLOT_ESCAPE = "1";

  if (Q7B_nil(Q7B_INTEGER(MilliSeconds))){ Q7B_EXCEPTION("Integer expected"); return; }
  if (Q7B_nil(Q7B_QSTRING(SignalProcedureName))){ Q7B_EXCEPTION("String expected"); return; }

  QTimer::singleShot(Q7B_IDqint64(MilliSeconds), (QObject *)(Object->ref), QString(SLOT_ESCAPE + Q7B_IDQString(SignalProcedureName) + "()").toAscii().constData());
}

