  if (Q7B_nil(Q7B_QSTRING(Default))){ Q7B_EXCEPTION("String expected"); return Q7B_idnil; }

  bool ok;
  QString text;
  
  text = QInputDialog::getText(qApp->focusWidget(), ((QString *) Title->ref)->isEmpty() ? *((QString *) Title->ref) : qApp->applicationName(), *((QString *) Prompt->ref), QLineEdit::Normal, ((QString *) Default->ref)->isEmpty() ? "" : *((QString *) Default->ref), &ok, 0);

