bool Q7B_copyFile (const QString& from, const QString& to)
{

  //QMessageBox::information(0, from, to);

  QString TO = to;
  if (from.toLower() != TO.toLower()){
    QFile file(from);
    if (file.exists()){
      QFile file2(TO);  
      file2.remove();
      
      if (QDir(TO).exists()){
        QFileInfo fi(from);
        QFileInfo fi2(TO);
        TO = fi2.absoluteFilePath(); // absoluteFilePath = dir       
        TO += QString("/") + fi.fileName();        
      }
      return file.copy(TO);
    }
  }
  return false;
} 

