Q7B Q7B_MESSAGEBOX(Q7B Icon, Q7B Title, Q7B Text, Q7B InformativeText, Q7B DetailedText, Q7B o1, Q7B o2, Q7B o3, Q7B o4, Q7B o5, Q7B o6, Q7B o7, Q7B o8, Q7B o9, Q7B o10)
{
  qint64 nIcon = Q7B_toInteger2(Icon);
  QMessageBox *qmessagebox = new QMessageBox(qApp->focusWidget());
  if (nIcon == 999999){ // MessageBoxSheet
#ifdef Q_WS_MAC
    qmessagebox->setWindowModality(Qt::WindowModal);
    nIcon = QMessageBox::NoIcon;
#endif
  }
  qmessagebox->setIcon((QMessageBox::Icon) nIcon);
  qmessagebox->setWindowTitle(Q7B_toString2(Title));
  qmessagebox->setText(Q7B_toString2(Text));
  
  for (qint64 i = 0; i < 10; i++){
    Q7B o; 
    switch(i){
      case 0: o = o1; break;
      case 1: o = o2; break;
      case 2: o = o3; break;
      case 3: o = o4; break;
      case 4: o = o5; break;
      case 5: o = o6; break;
      case 6: o = o7; break;
      case 7: o = o8; break;
      case 8: o = o9; break;
      case 9: o = o10; break;
    }
    if (i > 0 && o->ref == 0) goto _exec;
    if (QString(o->type) == typeid(Q7B_List).name()){
      Q7B_List *a = (Q7B_List *) o->ref;
      if (a->me.size() < 2){ Q7B_INVALIDARGUMENTEXCEPTION("List contains not enough values"); return Q7B_ID(0); }
      qmessagebox->addButton(Q7B_toString2(a->me.at(0)), (QMessageBox::ButtonRole) Q7B_toInteger2(a->me.at(1)));
    } else {
      qmessagebox->addButton((QMessageBox::StandardButton) Q7B_toInteger2(o));
    }
  }
/*
  
  if (o2->type == typeid(Q7B_List).name()){
    Q7B_List *a = (Q7B_List *) o2->ref;
    if (a->me.size() < 2){ Q7B_EXCEPTION("List contains not enough values"); return Q7B_ID(0); }
    qmessagebox->addButton(Q7B_toString2(a->me.at(0)), (QMessageBox::ButtonRole) toInteger2(a->me.at(1)));
  } else {
    qmessagebox->addButton((QMessageBox::StandardButton) toInteger2(o2));
  }
  */

_exec:

  qmessagebox->setInformativeText(Q7B_toString2(InformativeText));
  qmessagebox->setDetailedText(Q7B_toString2(DetailedText));

  qint64 n = qmessagebox->exec();
  if (n < (qint64) QMessageBox::Ok){
    if (qmessagebox->clickedButton() != 0){
      QList<QAbstractButton *> buttons = qmessagebox->buttons();
      for (qint64 i = 0; i < buttons.size(); i++){
        if (buttons.at(i) == qmessagebox->clickedButton()){
          return Q7B_ID(i);
        }
      }
    }     
  } else {
    return Q7B_ID(n);
  }
  return Q7B_ID(0);
}


