void Q7B_QPAINTER_DRAWLINE(Q7B qpainter, Q7B X1, Q7B Y1, Q7B X2, Q7B Y2)
{  
  if (Q7B_nil(Q7B_QPAINTER(qpainter))){ Q7B_EXCEPTION("QPainter expected"); return; }

  if (Q7B_nil(Q7B_INTEGER(X1))){ Q7B_EXCEPTION("Integer expected"); return; }
  if (Q7B_nil(Q7B_INTEGER(Y1))){ Q7B_EXCEPTION("Integer expected"); return; }
  if (Q7B_nil(Q7B_INTEGER(X2))){ Q7B_EXCEPTION("Integer expected"); return; }
  if (Q7B_nil(Q7B_INTEGER(Y2))){ Q7B_EXCEPTION("Integer expected"); return; }

  ((QPainter *) qpainter->ref)->drawLine( *((qint64 *) X1->ref), *((qint64 *) Y1->ref), *((qint64 *) X2->ref), *((qint64 *) Y2->ref));  
}

