Q7B Q7B_FILE_TRUNCATE(Q7B dummy, Q7B FileName)
{  
  if (Q7B_nil(Q7B_QSTRING(FileName))){ Q7B_EXCEPTION("String expected"); return Q7B_idnil; }

  Q7B_qfile.setFileName(Q7B_IDQString(FileName));
  if (Q7B_qfile.open(QIODevice::Truncate | QIODevice::WriteOnly)){
    Q7B_qfile.close();
    return Q7B_ID(true);
  }
  return Q7B_ID(false);
}

Q7B Q7B_FILE_READSTRING(Q7B dummy, Q7B FileName, Q7B Codec, Q7B AutoDetectUnicode, Q7B GenerateByteOrderMark)
{  
  if (Q7B_nil(Q7B_QSTRING(FileName))){ Q7B_EXCEPTION("String expected"); return Q7B_idnil; }
  if (Q7B_nil(Q7B_QSTRING(Codec))){ Q7B_EXCEPTION("String expected"); return Q7B_idnil; }
  if (Q7B_nil(Q7B_BOOLEAN(AutoDetectUnicode))){ Q7B_EXCEPTION("Boolean expected"); return Q7B_idnil; }
  if (Q7B_nil(Q7B_BOOLEAN(GenerateByteOrderMark))){ Q7B_EXCEPTION("Boolean expected"); return Q7B_idnil; }

  QString sFileName = Q7B_IDQString(FileName);
  QFile f(sFileName);
  bool b = false;

  if (sFileName.compare("stderr", Qt::CaseInsensitive) == 0) b = f.open(stderr, QIODevice::ReadOnly);
  else if (sFileName.compare("stdin", Qt::CaseInsensitive) == 0) b = f.open(stdin, QIODevice::ReadOnly);
  else if (sFileName.compare("stdout", Qt::CaseInsensitive) == 0) b = f.open(stdout, QIODevice::ReadOnly);
  else b = f.open(QIODevice::ReadOnly);

  QString s;
  QString sCodec = Q7B_IDQString(Codec);
  if (sCodec == ""){
    sCodec = "UTF-8";
  }

  if (b){
    //int nSize = f.size();
    if (f.size() > 100000000){ // avoid out of memory Qt/C++ runtime crash on large files
      QByteArray ba = f.readAll();

      if (sCodec == "Local8Bit"){
        s = QString(QString::fromLocal8Bit(ba.constData()));
      } else {
        s = QString(QString::fromUtf8(ba.constData()));
      }
      
      ba.clear();
    } else {

      QTextStream t(&f);
      
      t.setCodec(QTextCodec::codecForName(sCodec.toLatin1().data()));
      t.setAutoDetectUnicode(Q7B_IDbool(AutoDetectUnicode));
      t.setGenerateByteOrderMark(Q7B_IDbool(GenerateByteOrderMark));

      s = t.readAll();
    }
    f.close();
    return Q7B_ID(s);
  }

  return Q7B_ID("");
}

Q7B Q7B_READLINES(Q7B FileName, Q7B Codec)
{  
  return Q7B_FILE_READLINES(Q7B_ID(), FileName, Codec, Q7B_ID(true), Q7B_ID(true));
}

Q7B Q7B_WRITELINES(Q7B theLines, Q7B FileName, Q7B Codec)
{
  if (Q7B_nil(Q7B_LIST(theLines))){ Q7B_EXCEPTION("List expected"); return Q7B_idnil; }
  if (Q7B_nil(Q7B_QSTRING(FileName))){ Q7B_EXCEPTION("String expected"); return Q7B_idnil; }

  QStringList l = Q7B_IDQ7B_List(theLines)->toStringList();
  QString s;
  for (int i = 0; i < l.count(); i++){
    s.append(l.at(i) + "\n");
  }  

  return Q7B_FILE_WRITESTRING(Q7B_ID(), Q7B_ID(s), FileName, Q7B_ID(false), Codec, Q7B_ID(true), Q7B_ID(true));
}

Q7B Q7B_FILE_READLINES(Q7B dummy, Q7B FileName, Q7B Codec, Q7B AutoDetectUnicode, Q7B GenerateByteOrderMark)
{  
  if (Q7B_nil(Q7B_QSTRING(FileName))){ Q7B_EXCEPTION("String expected"); return Q7B_idnil; }
  if (Q7B_nil(Q7B_QSTRING(Codec))){ Q7B_EXCEPTION("String expected"); return Q7B_idnil; }
  if (Q7B_nil(Q7B_BOOLEAN(AutoDetectUnicode))){ Q7B_EXCEPTION("Boolean expected"); return Q7B_idnil; }
  if (Q7B_nil(Q7B_BOOLEAN(GenerateByteOrderMark))){ Q7B_EXCEPTION("Boolean expected"); return Q7B_idnil; }

  QString sFileName = Q7B_IDQString(FileName);
  QFile f(sFileName);
  bool b = false;

  if (sFileName.compare("stderr", Qt::CaseInsensitive) == 0) b = f.open(stderr, QIODevice::ReadOnly);
  else if (sFileName.compare("stdin", Qt::CaseInsensitive) == 0) b = f.open(stdin, QIODevice::ReadOnly);
  else if (sFileName.compare("stdout", Qt::CaseInsensitive) == 0) b = f.open(stdout, QIODevice::ReadOnly);
  else b = f.open(QIODevice::ReadOnly);

  QString sCodec = Q7B_IDQString(Codec);
  if (sCodec == ""){
    sCodec = "UTF-8";
  }

  QString s;
  if (b){
    //int nSize = f.size();
    if (f.size() > 100000000){ // avoid Qt crash on large files
      QByteArray ba = f.readAll();

      if (sCodec == "Local8Bit"){
        s = QString(QString::fromLocal8Bit(ba.constData()));
      } else {
        s = QString(QString::fromUtf8(ba.constData()));
      }
      
      ba.clear();
    } else {

      QTextStream t(&f);
      
      t.setCodec(QTextCodec::codecForName(sCodec.toLatin1().data()));
      t.setAutoDetectUnicode(Q7B_IDbool(AutoDetectUnicode));
      t.setGenerateByteOrderMark(Q7B_IDbool(GenerateByteOrderMark));

      s = t.readAll();
    }
    f.close();

    Q7B_List *a = new Q7B_List();
    Q7B q (new Q7B_id(typeid(Q7B_List).name(), a)); 

    QStringList l = s.split("\n");
    for (int i = 0; i < l.size(); i++){
      QString k = l.at(i);
      k = k.replace("\r", "");
       a->append( Q7B_ID( k ) );
    }

    return q;    
  }

  return Q7B_ID(Q7B_idnil);
}

Q7B Q7B_FILE_WRITESTRING(Q7B dummy, Q7B Text, Q7B FileName, Q7B Append, Q7B Codec, Q7B AutoDetectUnicode, Q7B GenerateByteOrderMark)
{  
  if (Q7B_nil(Q7B_QSTRING(Text))){ Q7B_EXCEPTION("String expected"); return Q7B_idnil; }
  if (Q7B_nil(Q7B_QSTRING(FileName))){ Q7B_EXCEPTION("String expected"); return Q7B_idnil; }
  if (Q7B_nil(Q7B_BOOLEAN(Append))){ Q7B_EXCEPTION("Boolean expected"); return Q7B_idnil; }
  if (Q7B_nil(Q7B_QSTRING(Codec))){ Q7B_EXCEPTION("String expected"); return Q7B_idnil; }
  if (Q7B_nil(Q7B_BOOLEAN(AutoDetectUnicode))){ Q7B_EXCEPTION("Boolean expected"); return Q7B_idnil; }
  if (Q7B_nil(Q7B_BOOLEAN(GenerateByteOrderMark))){ Q7B_EXCEPTION("Boolean expected"); return Q7B_idnil; }

  QString sFileName = Q7B_IDQString(FileName);
  QFile f(sFileName);
  bool b = false;

  if (sFileName.compare("stderr", Qt::CaseInsensitive) == 0) b = f.open(stderr, QIODevice::ReadOnly);
  else if (sFileName.compare("stdin", Qt::CaseInsensitive) == 0) b = f.open(stdin, QIODevice::ReadOnly);
  else if (sFileName.compare("stdout", Qt::CaseInsensitive) == 0) b = f.open(stdout, QIODevice::ReadOnly);
  else b = f.open(QIODevice::WriteOnly | (Q7B_IDbool(Append) ? QIODevice::Append : QIODevice::Truncate));

  if (b){
    QTextStream t(&f);

    QString sCodec = Q7B_IDQString(Codec);

    if (sCodec == "Local8Bit"){
    } else if (sCodec == ""){
      t.setCodec("UTF-8");
    } else {
      t.setCodec(sCodec.toAscii());
    }

    //t.setCodec(QTextCodec::codecForName(sCodec.toLatin1().data()));
    t.setAutoDetectUnicode(Q7B_IDbool(AutoDetectUnicode));
    t.setGenerateByteOrderMark(Q7B_IDbool(GenerateByteOrderMark));

    t << Q7B_IDQString(Text);
    f.close();

    return Q7B_ID( true );
  }

  return Q7B_ID( false );
}

