Q7B Q7B_FILE_COPY(Q7B dummy, Q7B SourceFileName, Q7B DestinationFileName, Q7B Overwrite)
{  
  if (Q7B_nil(Q7B_QSTRING(SourceFileName))){ Q7B_EXCEPTION("String expected"); return Q7B_idnil; }
  if (Q7B_nil(Q7B_QSTRING(DestinationFileName))){ Q7B_EXCEPTION("String expected"); return Q7B_idnil; }
  if (Q7B_nil(Q7B_BOOLEAN(Overwrite))){ Q7B_EXCEPTION("Boolean expected"); return Q7B_idnil; }

  if (Q7B_IDbool(Overwrite)){
    return Q7B_ID( Q7B_copyFile(Q7B_IDQString(SourceFileName), Q7B_IDQString(DestinationFileName)) );
  } else {
    return Q7B_ID( QFile::copy(Q7B_IDQString(SourceFileName), Q7B_IDQString(DestinationFileName)) );
  }
}

Q7B Q7B_FILE_MOVE(Q7B dummy, Q7B SourceFileName, Q7B DestinationFileName, Q7B Overwrite)
{  
  if (Q7B_nil(Q7B_QSTRING(SourceFileName))){ Q7B_EXCEPTION("String expected"); return Q7B_idnil; }
  if (Q7B_nil(Q7B_QSTRING(DestinationFileName))){ Q7B_EXCEPTION("String expected"); return Q7B_idnil; }
  if (Q7B_nil(Q7B_BOOLEAN(Overwrite))){ Q7B_EXCEPTION("Boolean expected"); return Q7B_idnil; }

  if (Q7B_IDbool(Overwrite)){
    if (Q7B_copyFile(Q7B_IDQString(SourceFileName), Q7B_IDQString(DestinationFileName))){
      QFile::remove(Q7B_IDQString(SourceFileName));
      return Q7B_ID( true );
    }
  } else {
    if (QFile::copy(Q7B_IDQString(SourceFileName), Q7B_IDQString(DestinationFileName))){
      QFile::remove(Q7B_IDQString(SourceFileName));
      return Q7B_ID( true );
    }
  }
  return Q7B_ID( false );
}

Q7B Q7B_FILE_RENAME(Q7B dummy, Q7B SourceFileName, Q7B DestinationFileName, Q7B Overwrite)
{  
  if (Q7B_nil(Q7B_QSTRING(SourceFileName))){ Q7B_EXCEPTION("String expected"); return Q7B_idnil; }
  if (Q7B_nil(Q7B_QSTRING(DestinationFileName))){ Q7B_EXCEPTION("String expected"); return Q7B_idnil; }
  if (Q7B_nil(Q7B_BOOLEAN(Overwrite))){ Q7B_EXCEPTION("Boolean expected"); return Q7B_idnil; }

  if (Q7B_IDbool(Overwrite) && QFile::exists(Q7B_IDQString(DestinationFileName))){
    QFile::remove(Q7B_IDQString(DestinationFileName));
  }
  return Q7B_ID( QFile::rename(Q7B_IDQString(SourceFileName), Q7B_IDQString(DestinationFileName)) );
}

