Q7B Q7B_FILE_ISREADABLE(Q7B dummy, Q7B FileName, Q7B Who)
{  
  if (Q7B_nil(Q7B_QSTRING(FileName))){ Q7B_EXCEPTION("String expected"); return Q7B_idnil; }
  if (Q7B_nil(Q7B_QSTRING(Who))){ Q7B_EXCEPTION("String expected"); return Q7B_idnil; }

  QString sWho = Q7B_IDQString(Who);
  if (sWho.isEmpty() || sWho.contains("User", Qt::CaseInsensitive)){
    QFileInfo f(Q7B_IDQString(FileName));
    if (f.exists()) return Q7B_ID( f.isReadable() );      
  } else if (sWho.contains("Owner", Qt::CaseInsensitive)){
    QFileInfo f(Q7B_IDQString(FileName));
    if (f.exists()) return Q7B_ID( f.permission(QFile::ReadOwner) );   
  } else if (sWho.contains("Group", Qt::CaseInsensitive)){
    QFileInfo f(Q7B_IDQString(FileName));
    if (f.exists()) return Q7B_ID( f.permission(QFile::ReadGroup) );   
  } else if (sWho.contains("Other", Qt::CaseInsensitive)){
    QFileInfo f(Q7B_IDQString(FileName));
    if (f.exists()) return Q7B_ID( f.permission(QFile::ReadOther) );   
  }
  return Q7B_ID( false );
}

