// *** PREFERENCES ***********************************************************************************

// saved on Windows at HKEY_CURRENT_USER/appname/OrganiziatonDefaults

Q7B Q7B_idPREFERENCES = Q7B_idnil;
Q7B Q7B_Preferences_Object(){ return Q7B_idPREFERENCES; }

Q7B Q7B_PREFERENCES_IDS(Q7B dummy)
{  
  if (Q7B_nil(Q7B_idPREFERENCES)){ Q7B_idPREFERENCES = Q7B(new Q7B_id(typeid(QSettings).name(), new QSettings(QSettings::NativeFormat , QSettings::UserScope, qApp->applicationName()))); }

  Q7B q (new Q7B_id(typeid(Q7B_List).name(), new Q7B_List(((QSettings *) Q7B_idPREFERENCES->ref)->allKeys()))); 
  return q;

  //return Q7B_ID( ((QSettings *) Q7B_idPREFERENCES->ref)->allKeys() );
}

void Q7B_PREFERENCES_REMOVEALL(Q7B dummy)
{  
  if (Q7B_nil(Q7B_idPREFERENCES)){ Q7B_idPREFERENCES = Q7B(new Q7B_id(typeid(QSettings).name(), new QSettings(QSettings::NativeFormat , QSettings::UserScope, qApp->applicationName()))); }

  ((QSettings *) Q7B_idPREFERENCES->ref)->clear();
}

Q7B Q7B_PREFERENCES_EXISTS(Q7B dummy, Q7B PreferenceId)
{  
  if (Q7B_nil(Q7B_idPREFERENCES)){ Q7B_idPREFERENCES = Q7B(new Q7B_id(typeid(QSettings).name(), new QSettings(QSettings::NativeFormat , QSettings::UserScope, qApp->applicationName()))); }
  if (Q7B_nil(Q7B_QSTRING(PreferenceId))){ Q7B_EXCEPTION("String expected"); return Q7B_idnil; }

  QStringList l = ((QSettings *) Q7B_idPREFERENCES->ref)->allKeys();
  return Q7B_ID( l.indexOf( *((QString *) PreferenceId->ref) ) >= 0 );
}

void Q7B_PREFERENCES_REMOVE(Q7B dummy, Q7B PreferenceId)
{  
  if (Q7B_nil(Q7B_idPREFERENCES)){ Q7B_idPREFERENCES = Q7B(new Q7B_id(typeid(QSettings).name(), new QSettings(QSettings::NativeFormat , QSettings::UserScope, qApp->applicationName()))); }
  if (Q7B_nil(Q7B_QSTRING(PreferenceId))){ Q7B_EXCEPTION("String expected"); return; }

  ((QSettings *) Q7B_idPREFERENCES->ref)->remove( *((QString *) PreferenceId->ref) );
}

Q7B Q7B_PREFERENCES_BOOLEAN(Q7B dummy, Q7B PreferenceId)
{  
  if (Q7B_nil(Q7B_idPREFERENCES)){ Q7B_idPREFERENCES = Q7B(new Q7B_id(typeid(QSettings).name(), new QSettings(QSettings::NativeFormat , QSettings::UserScope, qApp->applicationName()))); }
  if (Q7B_nil(Q7B_QSTRING(PreferenceId))){ Q7B_EXCEPTION("String expected"); return Q7B_idnil; }

  return Q7B_ID( ((QSettings *) Q7B_idPREFERENCES->ref)->value( *((QString *) PreferenceId->ref) ).toBool());  
}

