Q7B Q7B_DIR_COPY(Q7B SourceFilePath, Q7B DestinationFilePath)
{
  if (Q7B_nil(Q7B_QSTRING(SourceFilePath))){ Q7B_EXCEPTION("String expected"); return Q7B_idnil; }
  if (Q7B_nil(Q7B_QSTRING(DestinationFilePath))){ Q7B_EXCEPTION("String expected"); return Q7B_idnil; }

  QFileInfo fi(*((QString *) SourceFilePath->ref));  

  if (fi.isDir()){
    return Q7B_ID( Q7B_copyDir(*((QString *) SourceFilePath->ref), *((QString *) DestinationFilePath->ref), true) );
  }

  return Q7B_ID( false );
}    

