  if (Q7B_nil(Q7B_QSTRING(Title))){ Q7B_EXCEPTION("String expected"); return; }
  if (Q7B_nil(Q7B_QSTRING(Text))){ Q7B_EXCEPTION("String expected"); return; }
  if (Q7B_nil(Q7B_INTEGER(MessageBoxIcon))){ Q7B_EXCEPTION("Integer expected"); return; }
  if (Q7B_nil(Q7B_INTEGER(TimeOut))){ Q7B_EXCEPTION("Integer expected"); return; }
 
