void Q7B_APPLICATION_PRINTHTML(Q7B qapplication, Q7B Html)
{ 
  if (Q7B_nil(Q7B_QSTRING(Html))){ Q7B_EXCEPTION("String expected"); return; }

  QTextDocument *document = new QTextDocument();
  document->setHtml( *((QString *) Html->ref) );
  QPrinter printer;
  QPrintDialog *dialog = new QPrintDialog(&printer, qApp->activeWindow());
  if (dialog->exec() != QDialog::Accepted){
     delete document;     
     return;
  }
  document->print(&printer);
  delete document;     
}

void Q7B_APPLICATION_PRINTHTMLASPDF(Q7B qapplication, Q7B Html, Q7B PDFFilePath)
{ 
  if (Q7B_nil(Q7B_QSTRING(Html))){ Q7B_EXCEPTION("String expected"); return; }
  if (Q7B_nil(Q7B_QSTRING(PDFFilePath))){ Q7B_EXCEPTION("String expected"); return; }

  QTextDocument *document = new QTextDocument();
  document->setHtml( *((QString *) Html->ref) );
  QPrinter printer;
  printer.setOutputFormat(QPrinter::PdfFormat);
  printer.setOutputFileName( *((QString *) PDFFilePath->ref) );

  QPrintDialog *dialog = new QPrintDialog(&printer, qApp->activeWindow());
  if (dialog->exec() != QDialog::Accepted){
     delete document;     
     return;
  }
  document->print(&printer);
  delete document;     
}

