// *** QBUTTONGROUP ***********************************************************************************

Q7B Q7B_QBUTTONGROUP_INIT(QObject *parent, const char *objectName)
{
  QButtonGroup *o = new QButtonGroup( parent->isWidgetType() ? (QWidget *) parent : 0 );
  o->setProperty("Parent", (qint64) parent);
  o->setObjectName(objectName);

  Q7B_connectSlotsByName((QObject *) o, parent);

  Q7B q (new Q7B_id(typeid(QButtonGroup).name(), o, !parent->isWidgetType()));  
  return q;
}

void Q7B_QBUTTONGROUP_EXCLUSIVE(Q7B qbuttongroup, Q7B v)
{
  if (Q7B_nil(qbuttongroup)){ Q7B_NULLPOINTEREXCEPTION(); return; }

  if (Q7B_nil(Q7B_QBUTTONGROUP(qbuttongroup))){ Q7B_EXCEPTION("QButtonGroup expected"); return; }
  if (Q7B_nil(Q7B_BOOLEAN(v))){ Q7B_EXCEPTION("Boolean expected"); return; }

  ((QButtonGroup *) qbuttongroup->ref)->setExclusive( *((bool *) v->ref) );
}

Q7B Q7B_QBUTTONGROUP_EXCLUSIVE(Q7B qbuttongroup)
{
  if (Q7B_nil(qbuttongroup)){ Q7B_NULLPOINTEREXCEPTION(); return Q7B_idnil; }

  if (Q7B_nil(Q7B_QBUTTONGROUP(qbuttongroup))){ Q7B_EXCEPTION("QButtonGroup expected"); return Q7B_idnil; }

  return Q7B_ID( ((QButtonGroup *) qbuttongroup->ref)->exclusive() );
}

void Q7B_QBUTTONGROUP_ADDBUTTON(Q7B qbuttongroup, Q7B v)
{
  if (Q7B_nil(qbuttongroup)){ Q7B_NULLPOINTEREXCEPTION(); return; }

  if (Q7B_nil(Q7B_QBUTTONGROUP(qbuttongroup))){ Q7B_EXCEPTION("QButtonGroup expected"); return; }
  if (Q7B_nil(Q7B_QABSTRACTBUTTON(v))){ Q7B_EXCEPTION("QAbstractButton expected"); return; }

  ((QButtonGroup *) qbuttongroup->ref)->addButton( ((QAbstractButton *) v->ref) );
}

