Q7B Q7B_QTABLEWIDGET_FINDITEMINCOLUMN(Q7B qtablewidget, Q7B Text, Q7B Column, Q7B StartRow, Q7B MatchFlags)
{
  if (Q7B_nil(qtablewidget)){ Q7B_NULLPOINTEREXCEPTION(); return Q7B_idnil; }

  if (Q7B_nil(Q7B_QTABLEWIDGET(qtablewidget))){ Q7B_EXCEPTION("QTableWidget expected"); return Q7B_idnil; }
  if (Q7B_nil(Q7B_QSTRING(Text))){ Q7B_EXCEPTION("String expected"); return Q7B_idnil; }
  if (Q7B_nil(Q7B_INTEGER(Column))){ Q7B_EXCEPTION("Integer expected"); return Q7B_idnil; }
  if (Q7B_nil(Q7B_INTEGER(StartRow))){ Q7B_EXCEPTION("Integer expected"); return Q7B_idnil; }
  if (Q7B_nil(Q7B_INTEGER(MatchFlags))){ Q7B_EXCEPTION("Integer expected"); return Q7B_idnil; }

  QList<QTableWidgetItem *> l = ((QTableWidget *) qtablewidget->ref)->findItems( Q7B_IDQString(Text), (Qt::MatchFlags) Q7B_IDqint64(MatchFlags) );

  if (l.count()){
    for (int i = 0; i < l.count(); i++){
      QTableWidgetItem *twi = l.at(i);

      if (twi->column() == Q7B_IDqint64(Column) && twi->row() >= Q7B_IDqint64(StartRow)){
        return Q7B_ID( (qint64) twi->row() );
      }
    }
  }

  return Q7B_ID( (qint64) -1 );
}

