// *** QICON ***********************************************************************************

Q7B Q7B_QICON_INIT(QObject *parent, const char *objectName, Q7B v)
{
  if (v->type == typeid(QString).name()){
    return Q7B_ID( QIcon(*((QString *) v->ref)) );

  } else if (v->type == typeid(QByteArray).name()){
    return Q7B_ID( Q7B_QByteArray2QIcon(*((QByteArray *) v->ref)) );
  } else if (v->type == typeid(QIcon).name()){
    return Q7B_ID( QIcon(*((QIcon *) v->ref)) );
  } else {
    return Q7B_idnil; // TODO2 exception here
  }
}
