Q7B Q7B_QTEXTEDIT_INIT(QObject *parent, const char *objectName)
{
  QTextEdit* o = new QTextEdit(parent->isWidgetType() ? (QWidget *) parent : 0 );
  o->setProperty("Parent", (qint64) parent);
  o->setObjectName(objectName);

  Q7B_connectSlotsByName((QObject *) o, parent);

  Q7B q (new Q7B_id(typeid(QTextEdit).name(), o, !parent->isWidgetType()));    
  return q;
}

void Q7B_QTEXTEDIT_PRINT(Q7B qtextedit)
{
  if (Q7B_nil(qtextedit)){ Q7B_NULLPOINTEREXCEPTION(); return; }

  if (Q7B_nil(Q7B_QTEXTEDIT(qtextedit))){ Q7B_EXCEPTION("QTextEdit expected"); return; }

  QTextEdit *code = ((QTextEdit *) qtextedit->ref);
  QPrinter printer;

  QPrintDialog *dialog = new QPrintDialog(&printer);
  //dialog->setWindowTitle("Print Document");
  if (code->textCursor().hasSelection())
      dialog->addEnabledOption(QAbstractPrintDialog::PrintSelection);
  if (dialog->exec() != QDialog::Accepted)
      return;

  code->print(&printer);
}

void Q7B_QTEXTEDIT_PRINTTOPDF(Q7B qtextedit, Q7B FileName)
{
  if (Q7B_nil(qtextedit)){ Q7B_NULLPOINTEREXCEPTION(); return; }

  if (Q7B_nil(Q7B_QTEXTEDIT(qtextedit))){ Q7B_EXCEPTION("QTextEdit expected"); return; }

  if (Q7B_nil(Q7B_QSTRING(FileName))){ Q7B_EXCEPTION("String expected"); return; }

  QTextEdit *code = ((QTextEdit *) qtextedit->ref);
  QPrinter printer;

  printer.setOutputFileName(Q7B_IDQString(FileName));
  printer.setOutputFormat(QPrinter::PdfFormat);

  code->print(&printer);
}

