Q7B Q7B_QDOCKWIDGET_INIT(QObject *parent, const char *objectName)
{
  QDockWidget* o = new QDockWidget(parent->isWidgetType() ? (QWidget *) parent : 0 );
  o->setProperty("Parent", (qint64) parent);
  o->setObjectName(objectName);

  Q7B_connectSlotsByName((QObject *) o, parent);

  Q7B q (new Q7B_id(typeid(QDockWidget).name(), o, !parent->isWidgetType()));    
  return q;
}

Q7B Q7B_QDOCKWIDGET_WIDGET(Q7B qdockwidget)
{
  if (Q7B_nil(qdockwidget)){ Q7B_NULLPOINTEREXCEPTION(); return Q7B_idnil; }

  if (Q7B_nil(Q7B_QDOCKWIDGET(qdockwidget))){ Q7B_EXCEPTION("QDockWidget expected"); return Q7B_idnil; }
  
  return Q7B_ID( ((QDockWidget *) qdockwidget->ref)->widget() );
}

