// *** QTOOLBUTTON ***********************************************************************************

Q7B Q7B_QTOOLBUTTON_INIT(QObject *parent, const char *objectName)
{
  QToolButton* o = new QToolButton( parent->isWidgetType() ? (QWidget *) parent : 0);
  o->setProperty("Parent", (qint64) parent);
  o->setObjectName(objectName);

  Q7B_connectSlotsByName((QObject *) o, parent);

  Q7B q (new Q7B_id(typeid(QToolButton).name(), o, !parent->isWidgetType()));    
  return q;
}

void Q7B_QTOOLBUTTON_MENU(Q7B qtoolbutton, Q7B v)
{
  if (Q7B_nil(qtoolbutton)){ Q7B_NULLPOINTEREXCEPTION(); return; }

  if (Q7B_nil(Q7B_QTOOLBUTTON(qtoolbutton))){ Q7B_EXCEPTION("QToolButton expected"); return; }
  //if (Q7B_nil(Q7B_QMENU(v))){ Q7B_EXCEPTION("QMenu expected"); return; } // null zuweisung kann gewollt sein

  ((QToolButton *) qtoolbutton->ref)->setMenu( ((QMenu *) v->ref) );
}

Q7B Q7B_QTOOLBUTTON_MENU(Q7B qtoolbutton)
{
  if (Q7B_nil(qtoolbutton)){ Q7B_NULLPOINTEREXCEPTION(); return Q7B_idnil; }

  if (Q7B_nil(Q7B_QTOOLBUTTON(qtoolbutton))){ Q7B_EXCEPTION("QToolButton expected"); return Q7B_idnil; }

  return Q7B_ID( ((QToolButton *) qtoolbutton->ref)->menu() );
}

