void Q7B_MIDASSIGNMENT(Q7B *l, Q7B Position, Q7B Length, Q7B r)
{  
  if (Q7B_nil(*l)){ Q7B_NULLPOINTEREXCEPTION(); return; }

  if (Q7B_nil(Q7B_QSTRING(*l))){ Q7B_EXCEPTION("String expected"); return; }
  if (Q7B_nil(Q7B_INTEGER(Position))){ Q7B_EXCEPTION("Integer expected"); return; }
  if (Q7B_nil(Q7B_INTEGER(Length))){ Q7B_EXCEPTION("Integer expected"); return; }
  if (Q7B_nil(Q7B_QSTRING(r))){ Q7B_EXCEPTION("String expected"); return; }

  QString rr = Q7B_IDQString(r);
  Q7B a = *l;
  ((QString *) a->ref)->replace(Q7B_IDqint64(Position), Q7B_IDqint64(Length), rr.left(Q7B_IDqint64(Length)));
}

