QString Q7B_LoadString(Q7B Q7B_Object, QString sEncoding)
{
  if (Q7B_nil(Q7B_Object)){ Q7B_NULLPOINTEREXCEPTION(); return ""; }

  if (Q7B_nil(Q7B_QSTRING(Q7B_Object))){ Q7B_EXCEPTION("String expected"); return ""; }

  QString sWhere = *((QString *) Q7B_Object->ref);
  if (sWhere.startsWith("www.")){
    sWhere = "http://" + sWhere;
  }
  QString s;

  if (sWhere.startsWith("file:///")){
    sWhere = sWhere.mid(QString("file:///").length());
  }

  QUrl url(sWhere); 
  if (url.isValid() && !Q7B_fileExists(sWhere)){

    QHttp http;
    http.setHost(url.host());     

    QString q = url.encodedQuery();
    if (!q.isEmpty()){
      q = q.prepend("?");
    }
    QString z = QString(url.encodedPath()) + q;
    http.get(z);

    while(http.currentId() > 0 && http.error() == QHttp::NoError){
      qApp->processEvents();
    }
    if (http.error() != QHttp::NoError){
    } else {
      if (http.bytesAvailable()){
        QByteArray a = http.readAll();
        s = QString::fromUtf8(a.data(), a.size());
      }
    }

  } else {
    //QDir::setCurrent(qApp->applicationDirPath());
    
    QFile f;

    //QMessageBox::information(0, "1", qApp->applicationDirPath() + "/" + sWhere);

    if (QFile::exists(qApp->applicationDirPath() + "/" + sWhere)){ // important first check applicationDirPath
      f.setFileName(qApp->applicationDirPath() + "/" + sWhere);
    } else {
      f.setFileName(sWhere);
    }

    //QFile f(sWhere);
    if (!f.open(QIODevice::ReadOnly)){
    } else {
     // QMessageBox::information(0, "", "11 Q7B_LoadString");
      //int nSize = f.size();
      if (f.size() > 100000000){ // avoid Qt crash on large files

        //QMessageBox::information(0, "", "aa Q7B_LoadString");

        QByteArray ba = f.readAll();

        // QMessageBox::information(0, "", "bb Q7B_LoadString");

        if (sEncoding == "Local8Bit"){
          s = QString(QString::fromLocal8Bit(ba.constData()));
        } else {
          s = QString(QString::fromUtf8(ba.constData()));
        }
        
        ba.clear();
        //QMessageBox::information(0, "", "22 Q7B_LoadString");
      } else {

        QTextStream t(&f);
        if (sEncoding == "Local8Bit"){
        } else if (sEncoding == ""){
          t.setCodec("UTF-8");
        } else {
          t.setCodec(sEncoding.toAscii());
        }
        t.setAutoDetectUnicode(true);
        t.setGenerateByteOrderMark(true);

     //   QMessageBox::information(0, "", "1 Q7B_LoadString");
        s = t.readAll();      
       // QMessageBox::information(0, "", "2 Q7B_LoadString");
        f.close();
      }
    }
  }

  return s;
}

Q7B Q7B_READSTRING(Q7B Q7B_Object, Q7B Encoding)
{
  if (Q7B_nil(Q7B_QSTRING(Encoding))){ Q7B_EXCEPTION("String expected"); return Q7B_idnil; }

  return Q7B_ID( Q7B_LoadString(Q7B_Object, Q7B_IDQString(Encoding) ) );
}

Q7B Q7B_READCSTRING(Q7B Q7B_Object)
{
  return Q7B_ID( Q7B_LoadString(Q7B_Object, "ISO 8859-1" ) );
}

Q7B Q7B_WRITECSTRING(Q7B Q7B_Object, Q7B FilePathOrURL)
{
  if (Q7B_nil(Q7B_Object)){ Q7B_NULLPOINTEREXCEPTION(); return Q7B_idnil; }

  if (Q7B_nil(Q7B_QSTRING(Q7B_Object))){ Q7B_EXCEPTION("String expected"); return Q7B_idnil; }
  if (Q7B_nil(Q7B_QSTRING(FilePathOrURL))){ Q7B_EXCEPTION("String expected"); return Q7B_idnil; }

  QString sWhere = *((QString *) FilePathOrURL->ref);
 
  if (sWhere.startsWith("file:///")){
    sWhere = sWhere.mid(QString("file:///").length());
  }  
  
  QFile f(sWhere);
  if (!f.open(QIODevice::Truncate | QIODevice::WriteOnly)){
  } else {
    QTextStream t(&f);
    t.setCodec("ISO 8859-1");
   // t.setAutoDetectUnicode(true);
   // t.setGenerateByteOrderMark(true);
    t << *((QString *) Q7B_Object->ref);      
    f.close();

    return Q7B_ID( true );
  }
  
  return Q7B_ID( false );
}

Q7B Q7B_WRITESTRING(Q7B Q7B_Object, Q7B FilePathOrURL, Q7B Encoding)
{
  if (Q7B_nil(Q7B_Object)){ Q7B_NULLPOINTEREXCEPTION(); return Q7B_idnil; }

  if (Q7B_nil(Q7B_QSTRING(Q7B_Object))){ Q7B_EXCEPTION("String expected"); return Q7B_idnil; }
  if (Q7B_nil(Q7B_QSTRING(FilePathOrURL))){ Q7B_EXCEPTION("String expected"); return Q7B_idnil; }
  if (Q7B_nil(Q7B_QSTRING(Encoding))){ Q7B_EXCEPTION("String expected"); return Q7B_idnil; }

  QString sEncoding = Q7B_IDQString(Encoding);

  QString sWhere = *((QString *) FilePathOrURL->ref);
 
  if (sWhere.startsWith("file:///")){
    sWhere = sWhere.mid(QString("file:///").length());
  }  
  
  QFile f(sWhere);
  if (!f.open(QIODevice::Truncate | QIODevice::WriteOnly)){
  } else {
    QTextStream t(&f);

    if (sEncoding == "Local8Bit"){
    } else if (sEncoding == ""){
      t.setCodec("UTF-8");
    } else {
      t.setCodec(sEncoding.toAscii());
    }

    t.setAutoDetectUnicode(true);
    t.setGenerateByteOrderMark(true);
    t << *((QString *) Q7B_Object->ref);      
    f.close();

    return Q7B_ID( true );
  }
  
  return Q7B_ID( false );
}

