Q7B Q7B_LTRIM(Q7B Q7B_Object)
{
  if (Q7B_nil(Q7B_Object)){ Q7B_NULLPOINTEREXCEPTION(); return Q7B_idnil; }

  if (Q7B_nil(Q7B_QSTRING(Q7B_Object))){ Q7B_EXCEPTION("String expected"); return Q7B_idnil; }

  if (((QString *) Q7B_Object->ref)->isEmpty()) return Q7B_Object;

  int i = 0;
  while (i < ((QString *) Q7B_Object->ref)->length() && ((QString *) Q7B_Object->ref)->at(i).isSpace()) i++;

  return Q7B_ID( ((QString *) Q7B_Object->ref)->mid(i) );
}

Q7B Q7B_REVERSED(Q7B Q7B_Object)
{
  if (Q7B_nil(Q7B_Object)){ Q7B_NULLPOINTEREXCEPTION(); return Q7B_idnil; }

  if (Q7B_nil(Q7B_QSTRING(Q7B_Object))){ Q7B_EXCEPTION("String expected"); return Q7B_idnil; }

  QString s;

  for (int i = ((QString *) Q7B_Object->ref)->length() - 1; i >= 0; i--){
    s += ((QString *) Q7B_Object->ref)->at(i);
  }

  return Q7B_ID( s );
}

Q7B Q7B_RTRIM(Q7B Q7B_Object)
{
  if (Q7B_nil(Q7B_Object)){ Q7B_NULLPOINTEREXCEPTION(); return Q7B_idnil; }

  if (Q7B_nil(Q7B_QSTRING(Q7B_Object))){ Q7B_EXCEPTION("String expected"); return Q7B_idnil; }

  if (((QString *) Q7B_Object->ref)->isEmpty()) return Q7B_Object;

  int i = ((QString *) Q7B_Object->ref)->length();
  while (((QString *) Q7B_Object->ref)->at(i - 1).isSpace()) i--;

  return Q7B_ID( ((QString *) Q7B_Object->ref)->left(i) );
}

