  QStringList l = ((QString *) Q7B_Object->ref)->split( *((QString *) Separator->ref), QString::KeepEmptyParts, (*((bool *) CaseSensitive->ref) ?  Qt::CaseSensitive :  Qt::CaseInsensitive) );

  Q7B_List *a = new Q7B_List();
  Q7B q (new Q7B_id(typeid(Q7B_List).name(), a)); 

  for (int i = 0; i < l.size(); i++){

     a->append(Q7B_ID(l.at(i)));
  }

  return q;

//  return Q7B_ID( ((QString *) Q7B_Object->ref)->split( *((QString *) Separator->ref), QString::KeepEmptyParts, (*((bool *) CaseSensitive->ref) ?  Qt::CaseSensitive :  Qt::CaseInsensitive) ) );
