Q7B Q7B_STRCOMP(Q7B Q7B_Object, Q7B Search, Q7B ComparisionMode)
{
  if (Q7B_nil(Q7B_Object)){ Q7B_NULLPOINTEREXCEPTION(); return Q7B_idnil; }

  if (Q7B_nil(Q7B_QSTRING(Q7B_Object))){ Q7B_EXCEPTION("String expected"); return Q7B_idnil; }
  if (Q7B_nil(Q7B_QSTRING(Search))){ Q7B_EXCEPTION("String expected"); return Q7B_idnil; }
  if (Q7B_nil(Q7B_INTEGER(ComparisionMode))){ Q7B_EXCEPTION("Integer expected"); return Q7B_idnil; }
  
  if (Q7B_IDqint64(ComparisionMode)){ // binary
    return Q7B_ID( ((QString *) Q7B_Object->ref)->compare( *((QString *) Search->ref)) );
    
  } else { // text
    qint64 n = ((QString *) Q7B_Object->ref)->localeAwareCompare( *((QString *) Search->ref));
    if (n < 0) return Q7B_ID( -1 );
    if (n > 0)return Q7B_ID( 1 );
    return Q7B_ID( n );
  }
}

