QMap<QString, Q7B>q7b_ui;

QWidget* Q7B_CREATE_FROM_UI_FILE(QString uiName, QWidget *parentWidget)
{

#ifndef Q_WS_MAC
   QUiLoader loader;

   loader.clearPluginPaths(); // f?r Mac OS wird designer plugin aus system geladen -> absturz

   QFile file(uiName);
   if (file.open(QFile::ReadOnly)){
     QWidget *formWidget = loader.load(&file, parentWidget);
     file.close();
     return formWidget;
   }
#endif

   return 0;
}

