qint64 Q7B_lStartValue = 0;
qreal Q7B_dLastRND = 0;
  
void Q7B_RANDOMIZE()
{	
  Q7B_lStartValue = 0;

  static /**/ struct tm *timep;
  static /**/ time_t atime;

  time(&atime); timep=localtime(&atime);

  Q7B_lStartValue = timep->tm_sec + (qint64) timep;

  // in order to get different first number every time
  Q7B_lStartValue = 16807L * (Q7B_lStartValue % 127773L) - 2836L * (Q7B_lStartValue / 127773L);
  if (Q7B_lStartValue <= 0) Q7B_lStartValue += 2147483647;
  Q7B_dLastRND = (qreal) Q7B_lStartValue / 2147483648.0;

  Q7B_lStartValue = 16807L * (Q7B_lStartValue % 127773L) - 2836L * (Q7B_lStartValue / 127773L);
  if (Q7B_lStartValue <= 0) Q7B_lStartValue += 2147483647;
  Q7B_dLastRND = (qreal) Q7B_lStartValue / 2147483648.0;

}

Q7B Q7B_RANDOM(Q7B dValue)
{
  if (Q7B_nil(Q7B_FLOAT(dValue))){ Q7B_EXCEPTION("Float expected"); return Q7B_idnil; }

  qreal dVALUE = 0;

  if (*((qint64 *) dValue->ref) != 0){
    dVALUE = *((qint64 *) dValue->ref);
  }

  if (Q7B_dLastRND == 0){ // if Randomize Timer hasn't be called before, make automatically
     Q7B_RANDOMIZE();
  }

	if (*((qint64 *) dValue->ref) != 0){
    if (dVALUE == 0) return Q7B_ID( Q7B_dLastRND );

    if (dVALUE < 0){
      Q7B_lStartValue = dVALUE * 10000;

      Q7B_lStartValue = 16807L * (Q7B_lStartValue % 127773L) - 2836L * (Q7B_lStartValue / 127773L);
      if (Q7B_lStartValue <= 0) Q7B_lStartValue += 2147483647;
      Q7B_dLastRND = (qreal) Q7B_lStartValue / 2147483648.0;

      return Q7B_ID( Q7B_dLastRND );
    }
	}

  Q7B_lStartValue = 16807L * (Q7B_lStartValue % 127773L) - 2836L * (Q7B_lStartValue / 127773L);
  if (Q7B_lStartValue <= 0) Q7B_lStartValue += 2147483647;
  Q7B_dLastRND = (qreal) Q7B_lStartValue / 2147483648.0;

  if (*((qint64 *) dValue->ref) != 0 && dVALUE > 0){
    Q7B_dLastRND *= dVALUE;
  }

	return Q7B_ID( Q7B_dLastRND );
}

