Q7B Q7B_BITCLR(Q7B Value, Q7B Position)
{
  if (Q7B_nil(Value)){ Q7B_NULLPOINTEREXCEPTION(); return Q7B_idnil; }

  if (Q7B_nil(Q7B_INTEGER(Value))){ Q7B_EXCEPTION("Integer expected"); return Q7B_idnil; }
  if (Q7B_nil(Q7B_INTEGER(Position))){ Q7B_EXCEPTION("Integer expected"); return Q7B_idnil; }

  qint64 n = *((qint64 *) Value->ref);
  qint64 b = ~(1 << *((qint64 *) Position->ref));
  n &= b; 

	return Q7B_ID(n);
}

Q7B Q7B_BITSET(Q7B Value, Q7B Position)
{
  if (Q7B_nil(Value)){ Q7B_NULLPOINTEREXCEPTION(); return Q7B_idnil; }

  if (Q7B_nil(Q7B_INTEGER(Value))){ Q7B_EXCEPTION("Integer expected"); return Q7B_idnil; }
  if (Q7B_nil(Q7B_INTEGER(Position))){ Q7B_EXCEPTION("Integer expected"); return Q7B_idnil; }

  qint64 n = *((qint64 *) Value->ref);
  qint64 b = 1 << *((qint64 *) Position->ref);
  n |= b; 

	return Q7B_ID(n);
}

Q7B Q7B_BITTST(Q7B Value, Q7B Position)
{
  if (Q7B_nil(Value)){ Q7B_NULLPOINTEREXCEPTION(); return Q7B_idnil; }

  if (Q7B_nil(Q7B_INTEGER(Value))){ Q7B_EXCEPTION("Integer expected"); return Q7B_idnil; }
  if (Q7B_nil(Q7B_INTEGER(Position))){ Q7B_EXCEPTION("Integer expected"); return Q7B_idnil; }

  qint64 n = (*((qint64 *) Value->ref)) >> (*((qint64 *) Position->ref));
  qint64 b = 1;
  n &= b; 

  return Q7B_ID(n != 0);
}

