// *** VB6 & QBasic ********************************************************************************************************************************

const int Q7B_MAX_FILEHANDLE = 512;

const qint64 Q7B_pcode__INPUT = 1;
const qint64 Q7B_pcode__BINARY = 2;
const qint64 Q7B_pcode__RANDOM = 3;
const qint64 Q7B_pcode__OUTPUT = 4;
const qint64 Q7B_pcode__APPEND = 5;


struct Q7B_t_file2
{
  QFile f;
  qint64 nMode;
  qint64 nAccess;  
  qint64 nRecordLen;
  qint64 nRecordPos;
};

Q7B_t_file2 Q7B_file[Q7B_MAX_FILEHANDLE];

Q7B Q7B_FREEFILE(Q7B Range)
{
  if (Q7B_nil(Range)){ Q7B_NULLPOINTEREXCEPTION(); return Q7B_idnil; }

  if (Q7B_nil(Q7B_INTEGER(Range))){ Q7B_EXCEPTION("Integer expected"); return Q7B_idnil; }

  int i;
  i = 0;
  if (Q7B_IDqint64(Range) == 0){
    i = 1;
  } else {
    i = 256;
  }

  for (; i < Q7B_MAX_FILEHANDLE; i++){
    if (!Q7B_file[i].f.isOpen()){
      return Q7B_ID((qint64) i);        
    }
  }

  return Q7B_ID((qint64) 0);  
}

Q7B Q7B_EOF(Q7B FILEHANDLE)
{
  if (Q7B_nil(FILEHANDLE)){ Q7B_NULLPOINTEREXCEPTION(); return Q7B_idnil; }

  if (Q7B_nil(Q7B_INTEGER(FILEHANDLE))){ Q7B_EXCEPTION("Integer expected"); return Q7B_idnil; }

  qint64 nFILEHANDLE = Q7B_IDqint64(FILEHANDLE);

  if (!Q7B_file[nFILEHANDLE].f.isOpen()){  Q7B_EXCEPTION(QString("%1 (file) is not open").arg(nFILEHANDLE)); return Q7B_idnil; }
  
  return Q7B_ID( Q7B_file[nFILEHANDLE].f.atEnd() );
}

void Q7B_LINEINPUT(Q7B FILEHANDLE, Q7B *Var)
{
  if (Q7B_nil(FILEHANDLE)){ Q7B_NULLPOINTEREXCEPTION(); return; }

  if (Q7B_nil(Q7B_INTEGER(FILEHANDLE))){ Q7B_EXCEPTION("Integer expected"); return; }
  if (Q7B_nil(*Var)){ Q7B_NULLPOINTEREXCEPTION(); return; }

  qint64 nFILEHANDLE = Q7B_IDqint64(FILEHANDLE);

  if (!(nFILEHANDLE > 0 && nFILEHANDLE < Q7B_MAX_FILEHANDLE)){ Q7B_EXCEPTION(QString("%1 (file handle) is too big or too small").arg(nFILEHANDLE)); return; }  

  char ac[0xffff];

  if (Q7B_file[nFILEHANDLE].f.isOpen()){
    switch(Q7B_file[nFILEHANDLE].nMode){
   	  case Q7B_pcode__INPUT:
		  case Q7B_pcode__BINARY:
		  case Q7B_pcode__RANDOM:
        break;
      default:
        { Q7B_EXCEPTION(QString("%1 (file) is not open in the correct mode").arg(nFILEHANDLE)); return; }
    }

    int n = Q7B_file[nFILEHANDLE].f.readLine((char *) &ac, 0xffff - 1);			

    if (n == -1){ Q7B_EXCEPTION(QString("%1 (file) could not be read").arg(nFILEHANDLE)); return; }
    

    // get rid of the readed return character
    if (n > 0){
      if (ac[n - 2] == 0xd) ac[n - 2] = 0; // LINUX anderes return zeichen nur 1byte gro?
      else ac[n - 1] = 0;
    }

  } else { Q7B_EXCEPTION(QString("%1 (file) not open").arg(nFILEHANDLE)); return; }  

  QString s = QString::fromLocal8Bit(ac);

  //QMessageBox::information(0,"Q7B_LINEINPUT", s); 


  *Var = Q7B_ID( s ); 
  //Var->ByRefAssignment(Q7B_ID( s ));  
  //Var = Q7B_ID( s );
}	

void Q7B_CLOSEFILE(Q7B FILEHANDLE)
{
  if (Q7B_nil(FILEHANDLE)){ Q7B_NULLPOINTEREXCEPTION(); return; }

  if (Q7B_nil(Q7B_INTEGER(FILEHANDLE))){ Q7B_EXCEPTION("Integer expected"); return; }

  qint64 nFILEHANDLE = Q7B_IDqint64(FILEHANDLE);

  if (!(nFILEHANDLE > 0 && nFILEHANDLE < Q7B_MAX_FILEHANDLE)){ Q7B_EXCEPTION(QString("%1 (file handle) too big or too small").arg(nFILEHANDLE)); return; }  

  if (Q7B_file[nFILEHANDLE].f.isOpen()){
    Q7B_file[nFILEHANDLE].f.close();		
  }
}	

void Q7B_CLOSEALLFILES()
{
	for (int i = 1; i < Q7B_MAX_FILEHANDLE; i++){
 		if (Q7B_file[i].f.isOpen()) Q7B_file[i].f.close();		
	}
}

void Q7B_OPEN(Q7B FileName, Q7B Mode, Q7B FILEHANDLE, Q7B Len)
{  
  if (Q7B_nil(FileName)){ Q7B_NULLPOINTEREXCEPTION(); return; }

  if (Q7B_nil(Q7B_QSTRING(FileName))){ Q7B_EXCEPTION("String expected"); return; }
  if (Q7B_nil(Q7B_INTEGER(FILEHANDLE))){ Q7B_EXCEPTION("Integer expected"); return; }
  if (Q7B_nil(Q7B_INTEGER(Len))){ Q7B_EXCEPTION("Integer expected"); return; }

  qint64 nFILEHANDLE = Q7B_IDqint64(FILEHANDLE);

  if (!(nFILEHANDLE > 0 && nFILEHANDLE < Q7B_MAX_FILEHANDLE)){ Q7B_EXCEPTION(QString("%1 (file handle) too big or too small").arg(nFILEHANDLE)); return; }  

  int nMode = 0;
  QString sMode = Q7B_IDQString(Mode);

  if (sMode == "Input") nMode = Q7B_pcode__INPUT;
  else if (sMode == "Output") nMode = Q7B_pcode__OUTPUT;
  else if (sMode == "Append") nMode = Q7B_pcode__APPEND;
  else if (sMode == "Binary") nMode = Q7B_pcode__BINARY;
  else if (sMode == "Random") nMode = Q7B_pcode__RANDOM;

  Q7B_file[nFILEHANDLE].nMode = nMode; 
  Q7B_file[nFILEHANDLE].nRecordPos = 1;

  QIODevice::OpenMode n;
  n = 0;
	switch(nMode){
		case Q7B_pcode__OUTPUT:
			n = QFile::WriteOnly;
      Q7B_file[nFILEHANDLE].nRecordLen = 512;
			break;				
 		case Q7B_pcode__INPUT:
			n = QFile::ReadOnly;
      Q7B_file[nFILEHANDLE].nRecordLen = 512;
			break;
		case Q7B_pcode__APPEND:
			n = QFile::Append | QFile::WriteOnly; 
      Q7B_file[nFILEHANDLE].nRecordLen = 512;
			break;
		case Q7B_pcode__BINARY:
			n = QFile::ReadWrite;
      Q7B_file[nFILEHANDLE].nRecordLen = 512;
			break;
		case Q7B_pcode__RANDOM:
			n = QFile::ReadWrite;
      Q7B_file[nFILEHANDLE].nRecordLen = 128;
			break;
   default:
     { Q7B_EXCEPTION(QString("%1 (file handle) OPEN: wrong file mode").arg(nFILEHANDLE)); return; }
     break;
	}

  if (Q7B_IDqint64(Len) >= 0) Q7B_file[nFILEHANDLE].nRecordLen = Q7B_IDqint64(Len);

  QString s2 = Q7B_IDQString(FileName);
  if (!s2.contains("/") && !s2.contains("\\")){
    QString s = Q7B_IDQString(FileName);
    s2 = qApp->applicationDirPath();
    s2 += "/";
    s2 += s;
  }

  Q7B_file[nFILEHANDLE].f.setFileName(s2);
  bool b = Q7B_file[nFILEHANDLE].f.open(n);

  //QFile::FileError er = Q7B_file[nFILEHANDLE].f.error();

  if (!b){ Q7B_EXCEPTION(QString("%1 (file) could not be open").arg(nFILEHANDLE)); return; }  

  if (nMode == Q7B_pcode__APPEND){
    qint64 u;
    u = Q7B_file[nFILEHANDLE].f.size();
    Q7B_file[nFILEHANDLE].f.seek( u ); 
  } 

}

