Q7B Q7B_RUN(Q7B FilePath, Q7B Arguments)
{
  if (Q7B_nil(FilePath)){ Q7B_NULLPOINTEREXCEPTION(); return Q7B_idnil; }

  if (Q7B_nil(Q7B_QSTRING(FilePath))){ Q7B_EXCEPTION("String expected"); return Q7B_idnil; }
  if (Q7B_nil(Q7B_LIST(Arguments))){ Q7B_EXCEPTION("List expected"); return Q7B_idnil; }

  QStringList l = ((Q7B_List *) Arguments->ref)->toStringList();
  QProcess p;
  p.start(*((QString *) FilePath->ref), l);

  p.waitForFinished(-1);

  QString s = p.readAllStandardError();
  s += p.readAllStandardOutput();

  return Q7B_ID( s );
}

Q7B Q7B_LAUNCH(Q7B FilePath, Q7B Arguments, Q7B WorkingDirectory, Q7B Wait)
{
  if (Q7B_nil(FilePath)){ Q7B_NULLPOINTEREXCEPTION(); return Q7B_idnil; }

  if (Q7B_nil(Q7B_QSTRING(FilePath))){ Q7B_EXCEPTION("String expected"); return Q7B_idnil; }
  if (Q7B_nil(Q7B_LIST(Arguments))){ Q7B_EXCEPTION("List expected"); return Q7B_idnil; }
  if (Q7B_nil(Q7B_QSTRING(WorkingDirectory))){ Q7B_EXCEPTION("String expected"); return Q7B_idnil; }
  if (Q7B_nil(Q7B_BOOLEAN(Wait))){ Q7B_EXCEPTION("Boolean expected"); return Q7B_idnil; }

  QString workingDirectory = *((QString *) WorkingDirectory->ref);
  qint64 pid = 0;
  QStringList l = ((Q7B_List *) Arguments->ref)->toStringList();

  if (Q7B_IDbool(Wait)){
    return Q7B_ID( QProcess::execute(*((QString *) FilePath->ref), l) );
  } else {
    if (QProcess::startDetached(*((QString *) FilePath->ref), l, workingDirectory, &pid)){
      return Q7B_ID(pid);
    }
    return Q7B_ID((qint64)0);
  }
}

Q7B Q7B_SHELL(Q7B Command)
{
  if (Q7B_nil(Command)){ Q7B_NULLPOINTEREXCEPTION(); return Q7B_idnil; }

  if (Q7B_nil(Q7B_QSTRING(Command))){ Q7B_EXCEPTION("String expected"); return Q7B_idnil; }

  QString s = Q7B_IDQString(Command);
  
  return Q7B_ID( system(s.toLocal8Bit().data()) );
}

QString Q7B_PlaySound(QString sFilePath)
{
  if (!sFilePath.contains("/") && !sFilePath.contains("\\")){
    sFilePath = qApp->applicationDirPath() + "/" + sFilePath; // otherwise the sqlite db file is expected in the q7basic ide directory
  }  

  static Phonon::MediaObject *mediaObject = 0; 
  static Phonon::AudioOutput *audioOutput = 0; 

  if (mediaObject) delete mediaObject; // TODO2 letztes gespieltes object wird nicht freigegeben, besser global deklarieren
  if (audioOutput) delete audioOutput; // TODO2 letztes gespieltes object wird nicht freigegeben, besser global deklarieren

  mediaObject = new Phonon::MediaObject();
  audioOutput = new Phonon::AudioOutput(Phonon::MusicCategory);

  mediaObject->setCurrentSource(Phonon::MediaSource( sFilePath ));   
  Phonon::createPath(mediaObject, audioOutput);
  mediaObject->seek(0);
  mediaObject->play();

  //QMessageBox::information(0,"Q7B_PlaySound", "Q7B_PlaySound"); 
  
  return ( mediaObject->state() == Phonon::ErrorState ? mediaObject->errorString() : "" );
}

