void Q7B_fromXMLDictionary(QXmlStreamReader * xmlReader, Q7B_Dictionary *d, Q7B theArray2, Q7B theType2)
{
   QString sKey;

   while(!xmlReader->atEnd()){

      // QMessageBox::information(0, "array2", xmlReader->name().toString());

     if (xmlReader->isStartElement()){

        if (xmlReader->name() == "key")       
        {
          sKey = xmlReader->readElementText(); 
        }
        else if (xmlReader->name() == "integer")       
        {

          if (theArray2.isNull() && theType2.isNull()){
            d->me[sKey] = Q7B_ID( xmlReader->readElementText().toInt() );   
          } else if (theType2.isNull()){
            theArray2->q7b_array->append(Q7B_ID( xmlReader->readElementText().toInt() ));
          } else {
            theType2->q7b_type->append(Q7B_ID( xmlReader->readElementText().toInt() ));
          }      

/*
          if (theArray2.isNull()){
            d->me[sKey] = Q7B_ID( xmlReader->readElementText().toInt() );   
          } else {
            theArray2->q7b_array->append(Q7B_ID( xmlReader->readElementText().toInt() ));
          }            
          */
        }
        else if (xmlReader->name() == "float")
        {

          if (theArray2.isNull() && theType2.isNull()){
            d->me[sKey] = Q7B_ID( xmlReader->readElementText().toDouble() );   
          } else if (theType2.isNull()){
            theArray2->q7b_array->append(Q7B_ID( xmlReader->readElementText().toDouble() ));
          } else {
            theType2->q7b_type->append(Q7B_ID( xmlReader->readElementText().toDouble() ));
          }      

        }
        else if (xmlReader->name() == "boolean")
        {

          if (theArray2.isNull() && theType2.isNull()){
            d->me[sKey] = Q7B_ID( xmlReader->readElementText() == "0" ? false : true );   
          } else if (theType2.isNull()){
            theArray2->q7b_array->append(Q7B_ID( xmlReader->readElementText() == "0" ? false : true ));
          } else {
            theType2->q7b_type->append(Q7B_ID( xmlReader->readElementText() == "0" ? false : true ));
          }      

        }
        else if (xmlReader->name() == "string")
        {

          if (theArray2.isNull() && theType2.isNull()){
            d->me[sKey] = Q7B_ID( xmlReader->readElementText() );   
          } else if (theType2.isNull()){
            theArray2->q7b_array->append(Q7B_ID( xmlReader->readElementText() ));
          } else {
            theType2->q7b_type->append(Q7B_ID( xmlReader->readElementText() ));
          }       
/*
          if (theArray2.isNull()){
            d->me[sKey] = Q7B_ID( xmlReader->readElementText() );   
          } else {
            theArray2->q7b_array->append(Q7B_ID( xmlReader->readElementText() ));
          }   
          */
        }
        else if (xmlReader->name() == "datetime")
        {

          if (theArray2.isNull() && theType2.isNull()){
            d->me[sKey] = Q7B_ID( QDateTime::fromString(xmlReader->readElementText(), "yyyy-MM-dd hh:mm:ss") );   
          } else if (theType2.isNull()){
            theArray2->q7b_array->append(Q7B_ID( QDateTime::fromString(xmlReader->readElementText(), "yyyy-MM-dd hh:mm:ss") ));
          } else {
            theType2->q7b_type->append(Q7B_ID( QDateTime::fromString(xmlReader->readElementText(), "yyyy-MM-dd hh:mm:ss") ));
          }      

        }
        else if (xmlReader->name() == "decimal")
        {

          if (theArray2.isNull() && theType2.isNull()){
            d->me[sKey] = Q7B_ID( Q7B_Decimal(xmlReader->readElementText()) );   
          } else if (theType2.isNull()){
            theArray2->q7b_array->append(Q7B_ID( Q7B_Decimal(xmlReader->readElementText()) ));
          } else {
            theType2->q7b_type->append(Q7B_ID( Q7B_Decimal(xmlReader->readElementText()) ));            
          }      

        }
        else if (xmlReader->name() == "null")
        {
          xmlReader->readElementText();

          if (theArray2.isNull() && theType2.isNull()){
            d->me[sKey] = Q7B_idnil;   
          } else if (theType2.isNull()){
            theArray2->q7b_array->append(Q7B_idnil);
          } else {
            theType2->q7b_type->append(Q7B_idnil);            
          }      

        }
        else if (xmlReader->name() == "QByteArray")
        {
          QByteArray ba = QByteArray::fromBase64(xmlReader->readElementText().toAscii());

          if (theArray2.isNull() && theType2.isNull()){
            d->me[sKey] = Q7B_ID(ba); 
          } else if (theType2.isNull()){
            theArray2->q7b_array->append(Q7B_ID(ba));
          } else {
            theType2->q7b_type->append(Q7B_ID(ba));            
          }      

        }
        else if (xmlReader->name() == "QIcon")
        {

          QByteArray ba = QByteArray::fromBase64(xmlReader->readElementText().toAscii());

          if (theArray2.isNull() && theType2.isNull()){
            d->me[sKey] = Q7B_ID(Q7B_QByteArray2QIcon(ba)); 
          } else if (theType2.isNull()){
            theArray2->q7b_array->append(Q7B_ID(Q7B_QByteArray2QIcon(ba)));
          } else {
            theType2->q7b_type->append(Q7B_ID(Q7B_QByteArray2QIcon(ba)));            
          }      
          
        }
        else if (xmlReader->name() == "list" || xmlReader->name() == "array") // array provided for compatibility for IDS
        {
          Q7B_List *aa = new Q7B_List();
          Q7B q (new Q7B_id(typeid(Q7B_List).name(), aa));   

          if (theArray2.isNull() && theType2.isNull()){
            d->me[sKey] = q; 
          } else if (theType2.isNull()){
            theArray2->q7b_array->append(q);
          } else {
            theType2->q7b_type->append(q);            
          }       

          xmlReader->readNext();

          Q7B theArray;
          Q7B theType;
          Q7B_fromXMLList(xmlReader, aa, theArray, theType);

          xmlReader->readNext();

          //  QMessageBox::information(0, "", "array2");

        }
        else if (xmlReader->name() == "dictionary")
        {
          if (d == 0) return;

          Q7B_Dictionary *dd = new Q7B_Dictionary();
          Q7B q (new Q7B_id(typeid(Q7B_Dictionary).name(), dd));   

          if (theArray2.isNull() && theType2.isNull()){
            d->me[sKey] = q; 
          } else if (theType2.isNull()){
            theArray2->q7b_array->append(q);
          } else {
            theType2->q7b_type->append(q);            
          }       

          xmlReader->readNext();

          Q7B theArray;
          Q7B theType;
          Q7B_fromXMLDictionary(xmlReader, dd, theArray, theType);

          xmlReader->readNext();
        
        }
        else if (xmlReader->name() == "array2")
        {

          Q7B q (new Q7B_id());   

          
          if (theArray2.isNull() && theType2.isNull()){
            d->me[sKey] = q; 
          } else if (theType2.isNull()){
            theArray2->q7b_array->append(q);
          } else {
            theType2->q7b_type->append(q);
          }       
          /*
          if (theArray2.isNull()){
            d->me[sKey] = q; 
          } else {
            theArray2->q7b_array->append(q);
          }      */             

          xmlReader->readNext();

          while(!xmlReader->atEnd()){ if (xmlReader->isStartElement()) break; xmlReader->readNext(); }
          if (!(xmlReader->name() == "count")) return;
          q->q7b_array_count = xmlReader->readElementText().toInt();

          while(!xmlReader->atEnd()){ if (xmlReader->isStartElement()) break; xmlReader->readNext(); }
          if (!(xmlReader->name() == "index0")) return;
          q->array_indexes[0] = xmlReader->readElementText().toInt();

          while(!xmlReader->atEnd()){ if (xmlReader->isStartElement()) break; xmlReader->readNext(); }
          if (!(xmlReader->name() == "index1")) return;
          q->array_indexes[1] = xmlReader->readElementText().toInt();

          while(!xmlReader->atEnd()){ if (xmlReader->isStartElement()) break; xmlReader->readNext(); }
          if (!(xmlReader->name() == "index2")) return;
          q->array_indexes[2] = xmlReader->readElementText().toInt();

          while(!xmlReader->atEnd()){ if (xmlReader->isStartElement()) break; xmlReader->readNext(); }
          if (!(xmlReader->name() == "index3")) return;
          q->array_indexes[3] = xmlReader->readElementText().toInt();

          q->q7b_array = new QVector<Q7B>;

          xmlReader->readNext();

          Q7B theType;
          Q7B_fromXMLDictionary(xmlReader, d, q, theType);

          xmlReader->readNext();

        }
        else if (xmlReader->name() == "type")
        {

          Q7B q (new Q7B_id());   

          if (theArray2.isNull() && theType2.isNull()){
            d->me[sKey] = q; 
          } else if (theType2.isNull()){
            theArray2->q7b_array->append(q);
          } else {
            theType2->q7b_type->append(q);
          }       
          
          xmlReader->readNext();

          while(!xmlReader->atEnd()){ if (xmlReader->isStartElement()) break; xmlReader->readNext(); }
          if (!(xmlReader->name() == "count")) return;
          int n = xmlReader->readElementText().toInt();

          q->q7b_type = new QVector<Q7B>;

          xmlReader->readNext();
                    
          Q7B theArray;
          
          for (int wq = 0; wq < n; wq++){
            Q7B_fromXMLDictionary(xmlReader, d, theArray, q);
          }

          xmlReader->readNext();

        }
        else
        {                            
          xmlReader->raiseError();
          return;
        }

     } else if (xmlReader->isEndElement()){

       if (theArray2.isNull() && xmlReader->name() == "dictionary"){
         return;
       } else if (!theArray2.isNull() && xmlReader->name() == "array2"){
         return;
       } else if (!theType2.isNull() && xmlReader->name() == "type"){
         return;
       } else {
         xmlReader->readNext();
       }
     } else {
       xmlReader->readNext();
     }

   }
}

