Q7B Q7B_READLIST(Q7B Q7B_Object)
{
  QString s = Q7B_LoadString(Q7B_Object, "");

  Q7B_List *a = new Q7B_List();
  Q7B q (new Q7B_id(typeid(Q7B_List).name(), a));  

  QXmlStreamReader xmlReader(s.toUtf8());
  xmlReader.readNext(); // skip <?xml...
  xmlReader.readNext(); // V1.0

  while(!xmlReader.atEnd()){
//QString kkk = xmlReader.name().toString();
      
    if (xmlReader.isStartElement() && xmlReader.name() == "V1.0"){ xmlReader.readNext(); while(!xmlReader.atEnd() && !xmlReader.isStartElement()){ xmlReader.readNext(); }
     
      // xmlReader.name() == "array" provided for compatibility for IDS
      if (xmlReader.isStartElement() && (xmlReader.name() == "list" || xmlReader.name() == "array")){ xmlReader.readNext(); while(!xmlReader.atEnd() && !xmlReader.isStartElement()){ xmlReader.readNext(); }

        Q7B theArray;
        Q7B theType;
        Q7B_fromXMLList(&xmlReader, a, theArray, theType);

      }
      
    } 

    if (!xmlReader.atEnd()) xmlReader.readNext();
  }

  if (xmlReader.hasError()) return Q7B_idnil;
   
 // QMessageBox::information(0, "", xmlReader.errorString());

  return Q7B_ID( q );
}

Q7B Q7B_WRITELIST(Q7B Q7B_Object, Q7B FilePathOrURL)
{
  if (Q7B_nil(Q7B_Object)){ Q7B_NULLPOINTEREXCEPTION(); return Q7B_idnil; }

  if (Q7B_nil(Q7B_LIST(Q7B_Object))){ Q7B_EXCEPTION("List expected"); return Q7B_idnil; }
  if (Q7B_nil(Q7B_QSTRING(FilePathOrURL))){ Q7B_EXCEPTION("String expected"); return Q7B_idnil; }

  QString sWhere = *((QString *) FilePathOrURL->ref);
 
  if (sWhere.startsWith("file:///")){
    sWhere = sWhere.mid(QString("file:///").length());
  }  
  
  QFile f(sWhere);
  if (!f.open(QIODevice::Truncate | QIODevice::WriteOnly)){
  } else {

    QXmlStreamWriter xmlWriter(&f);
    xmlWriter.setAutoFormatting(true);

    xmlWriter.writeStartDocument();

      xmlWriter.writeStartElement("V1.0");

        xmlWriter.writeStartElement("list");

        QList<Q7B>l = ((Q7B_List *) Q7B_Object->ref)->values();
        for (int i = 0; i < l.size(); i++){
          Q7B q = l.at(i);
          Q7B_toXML2(xmlWriter, q);
        }        

      xmlWriter.writeEndElement();

    xmlWriter.writeEndDocument();

    f.close();

    return Q7B_ID( true );
  }
  
  return Q7B_ID( false );
}

Q7B Q7B_READDICTIONARY(Q7B Q7B_Object)
{
  QString s = Q7B_LoadString(Q7B_Object, "");

  Q7B_Dictionary *d = new Q7B_Dictionary();
  Q7B q (new Q7B_id(typeid(Q7B_Dictionary).name(), d));  

  QXmlStreamReader xmlReader(s.toUtf8());
  xmlReader.readNext(); // skip <?xml...
  xmlReader.readNext(); // V1.0

  while(!xmlReader.atEnd()){
      
    if (xmlReader.isStartElement() && xmlReader.name() == "V1.0"){ xmlReader.readNext(); while(!xmlReader.atEnd() && !xmlReader.isStartElement()){ xmlReader.readNext(); }
     
      if (xmlReader.isStartElement() && xmlReader.name() == "dictionary"){ xmlReader.readNext(); while(!xmlReader.atEnd() && !xmlReader.isStartElement()){ xmlReader.readNext(); }

        Q7B theArray;
        Q7B theType;
        Q7B_fromXMLDictionary(&xmlReader, d, theArray, theType);

      }

    }

    if (!xmlReader.atEnd()) xmlReader.readNext();
  }

  if (xmlReader.hasError()) return Q7B_idnil;
   
  return Q7B_ID( q );
}

Q7B Q7B_WRITEDICTIONARY(Q7B Q7B_Object, Q7B FilePathOrURL)
{
  if (Q7B_nil(Q7B_Object)){ Q7B_NULLPOINTEREXCEPTION(); return Q7B_idnil; }

  if (Q7B_nil(Q7B_DICTIONARY(Q7B_Object))){ Q7B_EXCEPTION("Dictionary expected"); return Q7B_idnil; }
  if (Q7B_nil(Q7B_QSTRING(FilePathOrURL))){ Q7B_EXCEPTION("String expected"); return Q7B_idnil; }

  QString sWhere = *((QString *) FilePathOrURL->ref);
 
  if (sWhere.startsWith("file:///")){
    sWhere = sWhere.mid(QString("file:///").length());
  }  
  
  QFile f(sWhere);
  if (!f.open(QIODevice::Truncate | QIODevice::WriteOnly)){
  } else {

    QXmlStreamWriter xmlWriter(&f);
    xmlWriter.setAutoFormatting(true);

    xmlWriter.writeStartDocument();

      xmlWriter.writeStartElement("V1.0");

        xmlWriter.writeStartElement("dictionary");

        QMap<QString, Q7B>m = ((Q7B_Dictionary *) Q7B_Object->ref)->keysvalues();

        QMapIterator<QString, Q7B> i(m);
        while (i.hasNext()) {
           i.next();
           
           xmlWriter.writeTextElement("key", i.key());
           Q7B_toXML2(xmlWriter, i.value());
        }

      xmlWriter.writeEndElement();

    xmlWriter.writeEndDocument();

    f.close();

    return Q7B_ID( true );
  }
  
  return Q7B_ID( false );
}

