QSqlDatabase *Q7B_psqldb = 0;

Q7B Q7B_PSQLCONNECT(Q7B Name, Q7B User, Q7B Password, Q7B Host, Q7B ConnectOptions, Q7B Port)
{
  if (Q7B_nil(Q7B_QSTRING(Name))){ Q7B_EXCEPTION("String expected"); return Q7B_idnil; }
  if (Q7B_nil(Q7B_QSTRING(User))){ Q7B_EXCEPTION("String expected"); return Q7B_idnil; }
  if (Q7B_nil(Q7B_QSTRING(Password))){ Q7B_EXCEPTION("String expected"); return Q7B_idnil; }
  if (Q7B_nil(Q7B_QSTRING(Host))){ Q7B_EXCEPTION("String expected"); return Q7B_idnil; }
  if (Q7B_nil(Q7B_QSTRING(ConnectOptions))){ Q7B_EXCEPTION("String expected"); return Q7B_idnil; }
  if (Q7B_nil(Q7B_INTEGER(Port))){ Q7B_EXCEPTION("Integer expected"); return Q7B_idnil; }

  if (!QSqlDatabase::contains("default.psql")){
    Q7B_psqldb = new QSqlDatabase(QSqlDatabase::addDatabase("QPSQL", "default.psql"));
  }
  if (Q7B_psqldb->isOpen()) Q7B_psqldb->close();

  Q7B_psqldb->setDatabaseName( Q7B_IDQString(Name) );
  Q7B_psqldb->setUserName( Q7B_IDQString(User) );
  Q7B_psqldb->setPassword( Q7B_IDQString(Password) );

  QString sHost = Q7B_IDQString(Host);
  if (!sHost.isEmpty()) Q7B_psqldb->setHostName( sHost );

  QString sConnectOptions = Q7B_IDQString(ConnectOptions);
  if (!sConnectOptions.isEmpty()) Q7B_psqldb->setConnectOptions( sConnectOptions ); 
  //else Q7B_psqldb->setConnectOptions("client_min_messages=WARNING");

  qint64 nPort = Q7B_IDqint64(Port);
  if (nPort > 0) Q7B_psqldb->setPort( nPort );      

  if (!Q7B_psqldb->open()){
    return Q7B_ID( Q7B_psqldb->lastError().text() ); 
  }
  return Q7B_ID( true );
}

void Q7B_PSQLDISCONNECT()
{
  if (Q7B_psqldb){
    Q7B_psqldb->close();
    delete Q7B_psqldb;
    Q7B_psqldb = 0;
    QSqlDatabase::removeDatabase("default.psql"); 
  }    
}

