Q7B Q7B_PSQL(Q7B SQL)
{
  if (Q7B_nil(SQL)){ Q7B_NULLPOINTEREXCEPTION(); return Q7B_idnil; }

  if (Q7B_nil(Q7B_QSTRING(SQL))){ Q7B_EXCEPTION("String expected"); return Q7B_idnil; }
  QString sSQL = Q7B_IDQString(SQL);
  
  if (!Q7B_psqldb->isOpen()){   
    if (!Q7B_psqldb->open()){   
      return Q7B_ID( Q7B_psqldb->lastError().text() ); 
    }
  }

  Q7B_psqldbq = QSqlQuery(*Q7B_psqldb);

  bool b = false;

  if (Q7B_binds.count()){
    Q7B_psqldbq.prepare( sSQL );
    for (int i = 0; i < Q7B_binds.count(); i++){
      Q7B_psqldbq.bindValue(QString(":BIND%1").arg(i + 1), Q7B_id2Variant(Q7B_binds.at(i), true, true));
    }
    Q7B_binds.clear();

    b = Q7B_psqldbq.exec();
  } else {
    b = Q7B_psqldbq.exec(sSQL);
  }

  if (b){

    QMap<int, QString> fieldnames;

    if (Q7B_psqldbq.first()){      

      Q7B_List *aa = new Q7B_List();
      Q7B qa (new Q7B_id(typeid(Q7B_List).name(), aa)); // gc << qa;

      QSqlRecord a = Q7B_psqldbq.record();
      for (int i = 0; i < a.count(); i++){
        fieldnames[i] = a.fieldName(i);
      }        

      do {
        Q7B_Dictionary *d = new Q7B_Dictionary();
        Q7B qq (new Q7B_id(typeid(Q7B_Dictionary).name(), d));

        a = Q7B_psqldbq.record();
        for (int i = 0; i < a.count(); i++){
          d->me[fieldnames[i]] = Q7B_ID( Q7B_Variant2id(a.value(i), true, true) );
        }

        aa->append(qq);

      } while (Q7B_psqldbq.next());

      return Q7B_ID(qa);
      
    }

    if (!sSQL.startsWith("SELECT ", Qt::CaseInsensitive)){
      return Q7B_ID(true);
    } else {
      Q7B_List *aa = new Q7B_List();
      Q7B qa (new Q7B_id(typeid(Q7B_List).name(), aa)); // gc << qa;

      return Q7B_ID(qa);
    }
  }

  return Q7B_ID( Q7B_psqldbq.lastError().text() );
}


