void Q7B_CLOSEALLDATABASES()
{
  Q7B_MYSQLDISCONNECT();
  Q7B_PSQLDISCONNECT();

  QMapIterator<QString, QSqlDatabase*> i(Q7B_sqlite_dbs);
  while (i.hasNext()) {
     i.next();
     QSqlDatabase *db = i.value();
     db->close();
     delete db;    
     QSqlDatabase::removeDatabase(i.key() + ".sqlite"); 
  }
  Q7B_sqlite_dbs.clear();

}

