void Q7B_TIMER_ENABLED(Q7B q7b_timer, Q7B v)
{
  if (Q7B_nil(q7b_timer)){ Q7B_NULLPOINTEREXCEPTION(); return; }

  if (Q7B_nil(Q7B_TIMER(q7b_timer))){ Q7B_EXCEPTION("Timer expected"); return; }
  if (Q7B_nil(Q7B_BOOLEAN(v))){ Q7B_EXCEPTION("Boolean expected"); return; }

  ((Q7B_Timer *) q7b_timer->ref)->setProperty("Enabled", Q7B_IDbool(v));

  if (Q7B_IDbool(v)){
    ((Q7B_Timer *) q7b_timer->ref)->t.start();
  } else {
    ((Q7B_Timer *) q7b_timer->ref)->t.stop();
  }
}

Q7B Q7B_TIMER_ENABLED(Q7B q7b_timer)
{
  if (Q7B_nil(q7b_timer)){ Q7B_NULLPOINTEREXCEPTION(); return Q7B_idnil; }

  if (Q7B_nil(Q7B_TIMER(q7b_timer))){ Q7B_EXCEPTION("Timer expected"); return Q7B_idnil; }

  return Q7B_ID( ((Q7B_Timer *) q7b_timer->ref)->property("Enabled") == true );
}

Q7B Q7B_TIMER_ISRUNNING(Q7B q7b_timer)
{
  if (Q7B_nil(q7b_timer)){ Q7B_NULLPOINTEREXCEPTION(); return Q7B_idnil; }

  if (Q7B_nil(Q7B_TIMER(q7b_timer))){ Q7B_EXCEPTION("Timer expected"); return Q7B_idnil; }

  return Q7B_ID( ((Q7B_Timer *) q7b_timer->ref)->t.isActive() );
}

void Q7B_TIMER_INTERVAL(Q7B q7b_timer, Q7B v)
{
  if (Q7B_nil(q7b_timer)){ Q7B_NULLPOINTEREXCEPTION(); return; }

  if (Q7B_nil(Q7B_TIMER(q7b_timer))){ Q7B_EXCEPTION("Timer expected"); return; }
  if (Q7B_nil(Q7B_INTEGER(v))){ Q7B_EXCEPTION("Integer expected"); return; }

  Q7B_Timer *tr = ((Q7B_Timer *) q7b_timer->ref);
  
  qint64 n = Q7B_IDqint64(v);
  tr->t.setInterval(n);

  if (n == 0 && tr->t.isActive()) tr->t.stop();
  if (tr->t.interval() >= 0 && tr->property("Enabled") == true) tr->t.start();
}

Q7B Q7B_TIMER_INTERVAL(Q7B q7b_timer)
{
  if (Q7B_nil(q7b_timer)){ Q7B_NULLPOINTEREXCEPTION(); return Q7B_idnil; }

  if (Q7B_nil(Q7B_TIMER(q7b_timer))){ Q7B_EXCEPTION("Timer expected"); return Q7B_idnil; }

  return Q7B_ID( ((Q7B_Timer *) q7b_timer->ref)->t.interval() );
}

void Q7B_TIMER_START(Q7B q7b_timer)
{
  if (Q7B_nil(q7b_timer)){ Q7B_NULLPOINTEREXCEPTION(); return; }

  if (Q7B_nil(Q7B_TIMER(q7b_timer))){ Q7B_EXCEPTION("Timer expected"); return; }
  
  ((Q7B_Timer *) q7b_timer->ref)->t.start();
}

void Q7B_TIMER_STOP(Q7B q7b_timer)
{
  if (Q7B_nil(q7b_timer)){ Q7B_NULLPOINTEREXCEPTION(); return; }

  if (Q7B_nil(Q7B_TIMER(q7b_timer))){ Q7B_EXCEPTION("Timer expected"); return; }

  ((Q7B_Timer *) q7b_timer->ref)->t.stop();
}

