// *** TEXTBOX ***********************************************************************************

Q7B Q7B_TEXTBOX_INIT(QObject *parent, const char *objectName)
{
  Q7B_TextBox* o = new Q7B_TextBox( parent->isWidgetType() ? (QWidget *) parent : 0 );
  o->setProperty("Parent", (qint64) parent);
  o->setObjectName(objectName);

  Q7B_connectSlotsByName((QObject *) o, parent);

  Q7B q (new Q7B_id(typeid(Q7B_TextBox).name(), o, !parent->isWidgetType()));   
  return q;
}

