Q7B_Screen::Q7B_Screen(QWidget *_parent) : QWidget (0)
{
  nFontWidth = 10;
  nFontHeight = 19;

  PI = 3.14159265;

  getWidth = 800;
  getHeight = 570;
  getColumn = 81;
  getLine = 30;
  

  bInputted = false;
  setWindowFlags(Qt::CustomizeWindowHint | Qt::WindowTitleHint | Qt::WindowMinimizeButtonHint | Qt::WindowCloseButtonHint  | Qt::WindowSystemMenuHint );
  bHide = false;

  setFocusPolicy(Qt::StrongFocus);

  for (int i = 0; i < 256; i++){
    switch(i % 16){
      case 0:
        colors[i] = Qt::black;
        break;
      case 1:
        colors[i] = Qt::darkBlue;
        break;
      case 2:
        colors[i] = Qt::darkGreen;
        break;
      case 3:
        colors[i] = Qt::darkCyan;
        break;
      case 4:
        colors[i] = Qt::darkRed;
        break;
      case 5:
        colors[i] = Qt::darkMagenta;
        break;
      case 6:
        colors[i] = QColor(153, 102, 0);
        break;
      case 7:
        colors[i] = Qt::lightGray;
        break;
      case 8:
        colors[i] = Qt::darkGray;
        break;
      case 9:
        colors[i] = Qt::blue;
        break;
      case 10:
        colors[i] = Qt::green;
        break;
      case 11:
        colors[i] = Qt::cyan;
        break;
      case 12:
        colors[i] = Qt::red;
        break;
      case 13:
        colors[i] = Qt::magenta;
        break;
      case 14:
        colors[i] = Qt::yellow;
        break;
      case 15:
        colors[i] = Qt::white;
        break;
    }
   
    if (i / 16 > 0){
      colors[i] = colors[i].dark(100 + 50 * i / 16);
    }    


  }

  nForecolor = 15;
  nBackcolor = 0;

 
  nInput2 = nInput = 0xffff; // no key pressed

  setWindowTitle("Screen");
  setWindowIconText("Screen");

  m2 = QPixmap(getWidth, getHeight);
  m2.fill(Qt::black);


  nForecolor = 15;
  nBackcolor = 0;

  bCursor = false;
  nCursorX = 1;
  nCursorY = 1;
  font = QFont("Courier");
  font.setPixelSize(16);


	setHidden(true);
  setFixedSize(getWidth, getHeight); // WORKAROUND

  nTimerId = startTimer( 500 ); 
  
  bCTRL = false;
  bSHIFT = false;

  bWasActivated = bActivated = false;
  setHidden(true);
  
  QRect r = QApplication::desktop()->screenGeometry(QApplication::desktop()->primaryScreen());
  move((r.width() / 2) - (width() / 2), (r.height() / 2) - (height() / 2));

}

