char *Q7B_Screen::inkey(int *nKeyPressed)
{
  //qApp->processEvents();
  activate();

  static char ac[1024];
/*
  if (nInput == 0){
    nInput = nInput;
  }*/

  // no key pressed
  if (nInput == 0xffff){ 
    *nKeyPressed = 1;

    ac[0] = '\0';
    return ac;
  }

  if (nInput == 0){ 
    *nKeyPressed = 2;

	  ac[0] = ' ';
    ac[1] = '\0';  

    
    return ac;
  }

  *nKeyPressed = 3;

	ac[0] = sInput.at(0).toAscii();
  ac[1] = '\0';  

  nInput = 0xffff; // no key pressed

  return ac;
}


char *Q7B_Screen::input()
{
  activate();
  
  static char ac[1024];

  int i = 0;
  while (nInput2 != Qt::Key_Enter && nInput2 != Qt::Key_Return){
    if (nInput2 != 0xffff){ // no key pressed = 0xffff

 // QMessageBox::information(this, "", QString("%1").arg(nInput2));

      if (nInput2 == Qt::Key_Backspace){
        if (i > 0){ // backspace
         i--;

         decCursorX();
         static QString ss = QString(QChar(' '));
         print(ss);
         decCursorX();
        }

        nInput2 = 0xffff; // no key pressed
        bInputted = false;
      } else if (nInput2 >= 32){

       QChar *c = sInput.data();
       ac[i] = c->toAscii();       

       print(sInput);
       nInput2 = 0xffff; // no key pressed
       bInputted = false;
       i++;
       if (i > 1023) break;
      
      } else { // ignore special keys
       nInput2 = 0xffff; // no key pressed
       bInputted = false;
      }
    }
    update();
    qApp->processEvents(QEventLoop::AllEvents, 100);
  };  

  setCursorX(1);
  incCursorY();

  nInput2 = 0xffff; // no key pressed
  bInputted = false;

	ac[i] = '\0';  

  return ac;  
}

