void Q7B_Screen::print(const QString &j)
{
  activate();

  p2.begin(&m2);

  p2.setPen( colors[nForecolor] );   
  p2.setBackgroundMode(Qt::OpaqueMode);
  p2.setBackground ( colors[nBackcolor] );
  p2.setFont(font); 


  int i = 0;
  int i2 = 0;
  bool b = false;
  QString k;

  do {

    i2 = j.indexOf("\n", i);
    if (i2 != -1){
      k = j.mid(i, i2 - i);
      i = i2;
      b = true;
    } else {
      k = j.mid(i);
      if (k == 0) break;
      b = false;
    }

  
   do {

      int n = k.length() + nCursorX;
      if (n > getColumn){
        n = getColumn - nCursorX;
       // p.drawText(getCursorX(), getCursorY(), k.left(n));

        p2.drawText(getCursorX(), getCursorY(), k.left(n));

        k = k.mid(n);

        nCursorX = 1;
        incCursorY();

      } else {
        

        p2.drawText(getCursorX(), getCursorY(), k);

        if (b){
          i++;
          nCursorX = 1;
          incCursorY();
        } else {
          nCursorX += k.length();
        }

        break;
      }

   } while (k.length());
 
 
} while (b);

  update();

  p2.end();

}


