void Q7B_BuiltinSubFunction_VM()
{
  QString s = Q7B_VM_bytecode.at(Q7B_VM_bytecode_pos++).toString(); 
  bool bReturn = Q7B_VM_bytecode.at(Q7B_VM_bytecode_pos++).toBool(); 

  // TODO generator f?r alle functions
  if (s == "Q7B__MSGBOX") if (bReturn) Q7B_push(Q7B__MSGBOX(Q7B_pop())); else Q7B__MSGBOX(Q7B_pop());
  if (s == "Q7B_PROPERTY") if (bReturn) Q7B_push(Q7B_PROPERTY(Q7B_pop(), Q7B_pop())); else Q7B_PROPERTY(Q7B_pop(), Q7B_pop());
  else s = s; // error
}

