  int nArgsCount = Q7B_VM_bytecode.at(Q7B_VM_bytecode_pos++).toInt() + 1; 

  // TODO generator f?r alle functions
  if (s == "Q7B_QSTRING_SIMPLIFIED") if (bReturn) Q7B_push(Q7B_QSTRING_SIMPLIFIED(Q7B_pop())); else Q7B_QSTRING_SIMPLIFIED(Q7B_pop());
  else if (s == "Q7B_QABSTRACTBUTTON_TEXT" && nArgsCount == 2) Q7B_QABSTRACTBUTTON_TEXT(Q7B_pop(), Q7B_pop()); 
  else if (s == "Q7B_QABSTRACTBUTTON_TEXT" && nArgsCount == 1) if (bReturn) Q7B_push(Q7B_QABSTRACTBUTTON_TEXT(Q7B_pop())); else Q7B_QABSTRACTBUTTON_TEXT(Q7B_pop());

  else if (s == "Q7B_DIR_LIST" && nArgsCount == 2) if (bReturn) Q7B_push(Q7B_DIR_LIST(Q7B_pop(), Q7B_pop())); else Q7B_DIR_LIST(Q7B_pop(), Q7B_pop());


