void Q7B_Call_VM()
{
  //QString sClass = Q7B_VM_bytecode.at(Q7B_VM_bytecode_pos++).toString(); 
  QString sProcedure = Q7B_VM_bytecode.at(Q7B_VM_bytecode_pos++).toString(); 
  bool bReturn = Q7B_VM_bytecode.at(Q7B_VM_bytecode_pos++).toBool(); 
  int nArgsCount = Q7B_VM_bytecode.at(Q7B_VM_bytecode_pos++).toInt(); 

  QList<Q7B> args;

  for (int i = 0; i < nArgsCount; i++){
    args << Q7B_pop();
  }

  Q7B theObject = Q7B_pop();
  QString sClass = theObject->type;

  if (bReturn) Q7B_push(VM_Q7B_Call(sClass, sProcedure, theObject->ref, args)); else VM_Q7B_Call(sClass, sProcedure, theObject->ref, args); 
}

